INITIALIZE =
  DECLARE
  element_manager 	= ElementManager;
  field_manager		= FieldManager;
  wizard		= Assistant;
  rc			= integer NOT NULL DEFAULT PU_OK;
  ct			= integer NOT NULL;
  changes		= ChoiceList DEFAULT NULL;

  ChangeField		= PROCEDURE RETURNING integer NOT NULL;
  ChangeFrame		= PROCEDURE RETURNING integer NOT NULL;
  ChangeCode		= PROCEDURE RETURNING integer NOT NULL;
  DefineChanges		= PROCEDURE RETURNING integer NOT NULL;
  ENDDECLARE
BEGIN

/*
**  Set up the variables
*/
changes = FIELD(ChangesHolder).ValueList;
changesTo = FIELD(ChangesToHolder).ValueList;

/*
**  Set the defaults and lists
*/
element_manager.GetApplicationsFromDatabase(
	appList=FIELD(applicationName).ValueList,
	exclusions='$_ApplicationName');

IF (FIELD(applicationName).ValueList.ChoiceItems.LastRow = 1) THEN
    CurFrame.InfoPopup(
	'Your database does not contain any applications.  ' +
	'Please run the upgrade utility ' + 
	'using a database with applications.',
	MessageType = MT_ERROR);
    EXIT;
ENDIF;

wizard.SetAttribute( 
	Caller			= CurFrame;
	ApplicationList		= FIELD(ApplicationName);
	ScopeOfChangeList	= FIELD(ScopeOfChange);
	ChangesToList		= FIELD(ChangesToHolder).ValueList;
	ChangesList		= FIELD(ChangesHolder).ValueList;
	Processor		= element_manager);

FOR ct = 1 TO 20 DO changes.ChoiceItems.InsertRow(); ENDFOR;
CALLPROC DefineChanges();
FOR ct = 20 DOWNTO 1 DO
  IF changes.ChoiceItems[ct].EnumText != '' THEN CONTINUE; ENDIF;
  changes.ChoiceItems.RemoveRow(ct);
ENDFOR;

FIELD(ChangesToHolder).ValueList.
	ChoiceItems[changesTo.IndexByText('Fields')].IsSelected = TRUE;
FIELD(ChangesHolder).ValueList.
	ChoiceItems[changes.IndexByText('FP_CLEAR')].IsSelected = TRUE;

/*
**  Run the wizard-controlled processing
*/
WHILE (rc != PU_CANCEL) DO
    rc = wizard.Wizard();
ENDWHILE;

/*
**  Close
*/
EXIT;

END;



