** -----------------------------------------------------------------------------
** Define list of available changes
** -----------------------------------------------------------------------------
**
**  Ensure the changes indexes are in order, without gaps, and not duplicated!
*/
PROCEDURE DefineChanges =
BEGIN
/*
**  Define Field Property changes (set enumvalue=1)
*/
changes.ChoiceItems[1].SetAttribute( EnumValue=1; EnumText='FP_CLEAR'; EnumBitmap=null;
	EnumDisplay='Change FP_CLEAR to FP_SOLID except in shapes and FreeTrim');

changes.ChoiceItems[2].SetAttribute( EnumValue=1; EnumText='Reset Gray'; EnumBitmap=null;
	EnumDisplay='Change CC_LIGHT_GRAY to CC_PALE_GRAY');

/*
**  Define Frame Property changes (set enumvalue=2)
*/
	/* none at present */

/*
**  Define Script changes (set enumvalue=3)
*/
	/* none at present */


END;

