/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Store Windows 7 settings in the frametemplate
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**  In principle, this can load into a frame as well as a frametemplate. The
**  comments below say "frametemplate", but both are possible.
**
**  In frames created from this frametemplate, some of the predefined
**  behaviours will be stored field-local, others will be stored in
**  the frame's topform. But the complete set of definitions must be
**  held within the frametemplate's stylesheet, as that is the only
**  genuinely portable piece of the frametemplate (for example when
**  an existing frame's templatestyle is reset or refreshed). Until
**  the stylesheet contains frameform as a style fieldtype, we use
**  the frametemplate's FieldDefaults[1] matrixfield.
*/
on click gobtn =
{

				$INFO('');
	/*
	**  Get the frametemplate to be setup
	*/
	frame = application.FetchComponent(componentname=name);
	if frame is null then
		$STRINFO('Unable to fetch component :frame from application :application')$EXP;
		resume next;
	endif;
	frametype = Lowercase(frame.ClassName);

	/*
	**  Set up the progress messages
	*/
	callproc SetupProgressMessages(frame=frame);

	/*
	**  Get the stylesheet and the "topform" location
	**
	*/
						$MSG('pulse'));
	stylesheet = frame.FieldDefaults;
	w7.StyleSheet = stylesheet;

	if frame.IsA(class=FrameTemplate) = TRUE then
		location = W7.GetFieldFromStyleSheet(
			f=FrameForm.Create(), styleindex=1, original=TRUE);
		locationinsource = TRUE;
	else
		location = frame.TopForm;
	endif;

	/*
	**  Load the buttonfield pulse and mouseover settings into the location
	**  Load the pulse bgbitmap into the location and the template field;
	*/
	status = LoadPulseSettings(location=location, locationinsource=locationinsource);

	/*
	**  Apply the pulse and mouseover settings and the bgcolor
	**  to topform as well
	**  ..if this is a frametemplate and writesettings... is set
	*/
	if frame.IsA(class=FrameTemplate) = TRUE
	and writesettingstotopform = TRUE then
		status = LoadPulseSettings(location=frame.TopForm);
		frame.TopForm.BgColor = field(topform_1_bgcolor).BgColor;
	endif;

	/*
	**  Copy settings to individual stylesheet fields ..if this is a frametemplate
	*/
	if frame.IsA(class=FrameTemplate) = TRUE then

		/*
		**  Add entries for frameform and mainbar to the stylesheet array
		**  ..if they are not present as standard matrixfield entries
		**
		**  (frameform at the start and mainbar at the end)
		*/
		added = AddMissingStyleClasses(stylesheet=stylesheet);

						$MSG('namedstyles'));
		/*
		**  Setup entries for any named styles for the relevant field types
		*/
		rc = SetupNamedStyles(stylesheet=stylesheet);

		/*
		**  Copy the bitmaps to the field entries to which they belong
		*/
						$MSG('copybitmaps'));
		status = LoadFieldBitmaps(stylesheet=stylesheet);

		/*
		**  Load field-specific taggedvalue settings
		*/
						$MSG('copytags'));
		status = LoadFieldTaggedValues(stylesheet=stylesheet);

		/*
		**  Apply style-specific settings to each template field that needs them
		*/
						$MSG('stylesettings'));
		status = ApplyStyleSettings(stylesheet=stylesheet);

		/*
		**  Remove entries for frameform and mainbar from the stylesheet array
		**  ..if they were added as standard matrixfield entries
		*/
		rc = RemoveMissingStyleClasses(stylesheet=stylesheet, added=added);

	endif;

	message 'Now open the template and save it, to save the applied settings';
}


