//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
//	Define and load pulse settings
//~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
procedure LoadPulseSettings(

	location		= Object default null;
	locationinsource	= integer not null default FALSE;

)=
declare
	eventkey	= varchar(32) not null;
	soar		= array of StringObject;
	responseset	= array of StringObject;
	intervalset	= array of IntegerObject;
	bitmapset	= array of BitmapObject;
	response	= StringObject;
	SD		= SpriteDescriptor;
	IE		= InputEvent;
	init_default	= StringObject default null;
	init_focus	= StringObject default null;
	init_moused	= StringObject default null;
	init_dragged	= StringObject default null;
	init_ordinary	= StringObject default null;
	enterstrings	= array of StringObject;
	exitstrings	= array of StringObject;
	i		= integer not null;
enddeclare
{
	/*
	**  Set the initial states to revert to when the pulse leaves
	*/
	init_default = ToString(text='4');
	init_focus = ToString(text='6');
	init_moused = ToString(text='2');
	init_dragged = ToString(text='2');
	init_ordinary = ToString(text='1');

	/*
	**  Load them
	**  (only need ispermanent=TRUE for the first time a particular
	**   tag is loaded; the tag remains permanent unless ispermanent=FALSE
	**   is explicitly specified)
	*/
	eventkey = IE.EventKey( action=IE_INIT,
		modifierkey=KB_NONE, responsecode=RE_DEFAULTBUTTON);
	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='initial_state', response=init_ordinary,
		ispermanent=TRUE, locationinsource=locationinsource);

	eventkey = IE.EventKey( action=IE_INIT,
		modifierkey=KB_NONE, responsecode=RE_FOCUSBUTTON);
	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='initial_state', response=init_focus,
		locationinsource=locationinsource);

	eventkey = IE.EventKey( action=IE_INIT,
		modifierkey=KB_NONE, responsecode=RE_MOUSEOVERBUTTON);
	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='initial_state', response=init_ordinary,
		locationinsource=locationinsource);

	eventkey = IE.EventKey( action=IE_INIT,
		modifierkey=KB_NONE, responsecode=RE_DRAGBUTTON);
	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='initial_state', response=init_dragged,
		locationinsource=locationinsource);

	eventkey = IE.EventKey( action=IE_INIT,
		modifierkey=KB_NONE, responsecode=RE_OTHERBUTTON);
	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='initial_state', response=init_ordinary,
		locationinsource=locationinsource);

				$STRINFO($t+$t + '"init" settings loaded into &(frame.Name)')$EXP;

	bitmapset[1] = button_bmpfld.BgBitmap.Duplicate();
	eventkey = IE.EventKey( action=IE_PULSE,
		modifierkey=KB_NONE, responsecode=RE_PULSE);
	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='event_bitmap', response=bitmapset,
		ispermanent=TRUE,
		locationinsource=locationinsource);

		$STRINFO($t+$t + '"event bitmap" loaded into &(frame.Name)')$EXP;

	/*
	**  Create and load the interval and response arrays for the pulse behaviour
	**  (load interval once only, for the general case. If we load it for
	**  every case, then every case runs at every interval! Internal
	**  processing will determine the right one to run at each pulse point)
	*/
	intervalset[1].Value = 1000;
	intervalset.ClientInteger = 0;	//delay

	eventkey = IE.EventKey( action=IE_PULSE,
		modifierkey=KB_NONE, responsecode=RE_PULSE);
	responseset = soar.Duplicate();
	responseset[1] = ToString(text='1');
	responseset[2] = ToString(text='1');

	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='event_responses', response=responseset,
		intervals=intervalset, ispermanent=TRUE,
		locationinsource=locationinsource);


	eventkey = IE.EventKey( action=IE_PULSE,
		modifierkey=KB_NONE, responsecode=RE_DEFAULTBUTTON);
	responseset = soar.Duplicate();
	responseset[1] = ToString(text='4');
	responseset[2] = ToString(text='5');

	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='event_responses', response=responseset,
		locationinsource=locationinsource);

	eventkey = IE.EventKey( action=IE_PULSE,
		modifierkey=KB_NONE, responsecode=RE_FOCUSBUTTON);
	responseset = soar.Duplicate();
	responseset[1] = ToString(text='6');
	responseset[2] = ToString(text='7');

	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='event_responses', response=responseset,
		locationinsource=locationinsource);

	eventkey = IE.EventKey( action=IE_PULSE,
		modifierkey=KB_NONE, responsecode=RE_MOUSEOVERBUTTON);
	responseset = soar.Duplicate();
	responseset[1] = ToString(text='2');
	responseset[2] = ToString(text='2');

	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='event_responses', response=responseset,
		locationinsource=locationinsource);

	eventkey = IE.EventKey( action=IE_PULSE,
		modifierkey=KB_NONE, responsecode=RE_DRAGBUTTON);	//downbutton really
	responseset = soar.Duplicate();
	responseset[1] = ToString(text='9');
	responseset[2] = ToString(text='10');

	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='event_responses', response=responseset,
		locationinsource=locationinsource);

	eventkey = IE.EventKey( action=IE_PULSE,
		modifierkey=KB_NONE, responsecode=RE_OTHERBUTTON);	//doesnt pulse!
	responseset = soar.Duplicate();
	responseset[1] = ToString(text='1');
	responseset[2] = ToString(text='1');

	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='event_responses', response=responseset,
		locationinsource=locationinsource);

		$STRINFO($t+$t + '"pulse" settings loaded into &(frame.Name)')$EXP;

	/*
	**  Set the mouseover behaviour
	*/
	for i = 1 to 4 do
		enterstrings.InsertRow();
		exitstrings.InsertRow();
	endfor;
	enterstrings[1].SetAttribute(errorstatus=RE_OTHERBUTTON, value='2');
	enterstrings[2].SetAttribute(errorstatus=RE_DEFAULTBUTTON, value='2');
	enterstrings[3].SetAttribute(errorstatus=RE_FOCUSBUTTON, value='2');
	enterstrings[4].SetAttribute(errorstatus=RE_DRAGBUTTON, value='10');
	exitstrings[1].SetAttribute(errorstatus=RE_OTHERBUTTON, value='1');
	exitstrings[2].SetAttribute(errorstatus=RE_DEFAULTBUTTON, value='1');
	exitstrings[3].SetAttribute(errorstatus=RE_FOCUSBUTTON, value='6');
	exitstrings[4].SetAttribute(errorstatus=RE_DRAGBUTTON, value='9');
	for i = 1 to 4 do
		eventkey = IE.EventKey( action=IE_MOUSEENTER,
		modifierkey=KB_NONE, responsecode=enterstrings[i].errorstatus);
		response = enterstrings[i];
		IE.LoadEventBehavior(location=location, eventkey=eventkey,
			responsetype='event_responses', response=response,
			locationinsource=locationinsource);

		eventkey = IE.EventKey( action=IE_MOUSEEXIT,
		modifierkey=KB_NONE, responsecode=exitstrings[i].errorstatus);
		response = exitstrings[i];
		IE.LoadEventBehavior(location=location, eventkey=eventkey,
			responsetype='event_responses', response=response,
			locationinsource=locationinsource);
	endfor;

	/*
	**  Set the losefocus behaviour
	*/
	eventkey = IE.EventKey( action=IE_LOSEFOCUS,
		modifierkey=KB_NONE, responsecode=RE_OTHERBUTTON);
	response = ToString(text='1');
	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='event_responses', response=response,
		locationinsource=locationinsource);

	/*
	**  Set the buttonfield individual image profiles
	**  (only 9 and 10 need profiles set - the others all behave correctly,
	**  but these have no bottom edge to their inner margin)
	*/
	button_bmpfld.UpdBackground(
		imageindex=9,
		cornersize=2,
		borderwidth=2,
		borderstyle=$OS_CONCENTRIC,
		updateimageprofile=TRUE);

	button_bmpfld.UpdBackground(
		imageindex=10,
		cornersize=2,
		borderwidth=2,
		borderstyle=$OS_CONCENTRIC,
		updateimageprofile=TRUE);

	/*
	**  Set the entryfield individual image profiles
	**  (all need profiles set, because their edges are independently
	**  coloured)
	*/
	for i = 1 to 3 do
		entry_bmpfld.UpdBackground(	//<<<<TEST
			imageindex=i,
			cornersize=2,
			borderwidth=1,
			borderstyle=$OS_CONCENTRIC,
			updateimageprofile=TRUE);
	endfor;

	/*
	**  Store the adjusted bitmap at the location too
	*/
	bitmapset[1] = button_bmpfld.BgBitmap.Duplicate();

	eventkey = IE.EventKey( action=IE_PULSE,
		modifierkey=KB_NONE, responsecode=RE_PULSE);
	IE.LoadEventBehavior(location=location, eventkey=eventkey,
		responsetype='event_bitmap', response=bitmapset,
		locationinsource=locationinsource);

	/*
	**  Write the adjusted bitmap to file ..if requested
	*/
	if writebitmap = TRUE then
		button_bmpfld.BgBitmap.WriteToFile(
			filename=filename, format=BF_BMP);
	endif;

	return ER_OK;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**  Apply style settings to individual stylefields
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure ApplyStyleSettings(

	stylesheet		= array of FormField default null;

)=
declare
	classname		= varchar(32) not null;
	typefacename		= varchar(32) not null;
	styleno			= integer not null;
	i			= integer not null;
	j			= integer not null;
	k			= integer not null;
	fields			= array of FormField default null;
	fld			= FormField default null;
	tbl			= TableField default null;
	ctbl		= TableField default null;
	sub			= SubForm default null;
	tbf			= TabFolder default null;
	tab			= TabField default null;
	common			= ButtonField;
	trigger			= ButtonField default null;
	mat			= MatrixField default null;
	fldsample		= FormField default null;
	topbarbtn		= FormField default null;
	bar			= MainBar default null;
	mainbarsample		= MainBar;
	formmat			= MatrixField default null;
	mainbarmat		= MatrixField;
	topform			= FrameForm default null;
	mainbaradded		= integer not null default FALSE;
	orangeno		= integer not null default 0;
	tblhdrno		= integer not null default 0;
	stripno			= integer not null default 0;
	groupboxno		= integer not null default 0;
	btnbarno		= integer not null default 0;
	lw			= integer not null default 0;
	custom			= integer not null default FALSE;
	workingbgcolor		= integer not null default 0;
	marginbgcolor		= integer not null default 0;
	triggerbgcolor		= integer not null default 0;
	workingfgcolor		= integer not null default 0;
	marginfgcolor		= integer not null default 0;
	triggerfgcolor		= integer not null default 0;
enddeclare
{
	/*
	**  Load the colours
	*/
	workingbgcolor = field(display_1_bgcolor).BgColor;
	marginbgcolor = field(topform_1_bgcolor).BgColor;
	triggerbgcolor = field(buttonfield_1_bgcolor).BgColor;

	workingfgcolor = field(display_1_fgcolor).BgColor;
	marginfgcolor = field(topform_1_fgcolor).BgColor;
	triggerfgcolor = field(buttonfield_1_fgcolor).BgColor;

	/*
	**  Set up the common and trigger (buttons etc) settings
	**  (using buttonfields, as these have all the shared attributes)
	*/
	common.SetAttribute(
		typeface=TF_NATIVE_FONT,
////		typefacename='calibri',		//W7 documents only, not entryfields
/**/		typefacename='segoe UI',
		typesize=9,
		requirerealfield=TRUE,
		bgpattern=FP_SOLID,
		bgcolor=workingbgcolor,
		fgcolor=workingfgcolor,
		isautosized=FALSE,
		isreverse=FALSE,
		clientdata=null);

	trigger = common.Duplicate();

	trigger.SetAttribute(
		typefacename='segoe UI',
		bgcolor=triggerbgcolor,
		fgcolor=triggerfgcolor,
		clientdata=null);

	/*
	**  Process each field class in turn;
	**  Use a copy of the first stylefield as a sample in each case
	*/
	for i = 1 to stylesheet.LastRow do
		mat = stylesheet[i];
		classname = mat.ClientText;
		fields = mat.ChildFields;
		k = mat.ChildFields.LastRow;

		if classname = '' then
			continue;
		endif;
		if fields.LastRow = 0 then
			continue;
		endif;

		fldsample = fields[1].Duplicate();

		/*
		**  Distinguish between single and multiline entryfields
		*/
		if classname != 'entryfield' then
		elseif EntryField(fldsample).IsMultiline = TRUE then
			classname= 'm_entryfield';
		endif;

		/*
		**  Get any named stylenos for this field type
		*/
		orangeno = W7.StyleIndexFromName(fld=fldsample, stylename='w7orange');
		tblhdrno = W7.StyleIndexFromName(fld=fldsample, stylename='w7tblheader');
		stripno = W7.StyleIndexFromName(fld=fldsample, stylename='w7strip');
		groupboxno = W7.StyleIndexFromName(fld=fldsample, stylename='w7groupbox');
		btnbarno = W7.StyleIndexFromName(fld=fldsample, stylename='w7buttonbar');
/*T*/		btnbarno = $FORM_BTNBAR_STYLENO;

		/*
		**  Work through the set of actual or potential stylefields
		**
		**  We apply the generic all-fields settings, then the generic
		**  class-specific settings (including bdp settings), then
		**  the namedstyle-specific settings for that class, then the
		**  context-specific settings for that class in that context.
		**  We do namedstyle before context in case someone allocates
		**  a context styleno to a named style (of course we would never
		**  do such a thing)
		*/
		for j = 1 to $MAXSTYLEFIELDS do
			styleno = j;

			custom = TRUE;

			/*
			**  Use a copy of the sample to ensure we have a field
			*/
			if fields.LastRow < j then
				mat.Rows = j;
				mat.InsertChild(
					row=j, fieldtoinsert=fldsample.Duplicate());
			endif;

			fld = fields[j];

			/*
			**  Apply all-field settings
			*/
			fld.SetAttribute(
				typeface=common.TypeFace,
				typefacename=common.TypeFaceName,
				typesize=common.TypeSize,
				requirerealfield=common.RequireRealField,
				bgpattern=common.BgPattern,
				bgcolor=common.BgColor,
				fgcolor=common.FgColor,
				isautosized=common.IsAutoSized,
				isreverse=common.IsReverse,
				clientdata=null);

			case classname of

			/*
			**  Apply buttonfield settings
			*/
			'buttonfield':
			{
				/*general settings for buttonfields*/
				status = fld.SetAttribute(
					typefacename=trigger.TypeFaceName,
					bgcolor=trigger.BgColor,
					buttonstyle=BS_DEFAULT,
					focusbehavior=FT_TAKEFOCUS,
					outlinecolor=CC_BLUE,
					outlinestyle=OS_SOLID,
					outlinewidth=LW_NOLINE,
					height=229,
					clientdata=null);

				/*general bdp settings for buttonfields*/
				if fld.BgBitmap is not null then
					status = fld.SetAttribute(
						bgdisplaypolicy=BDP_CORNERED,
						bgpattern=FP_BITMAPCLEAR,
						bmpdisplaybehavior=BDB_OPAQUE,
						clientdata=null);

					status = fld.BgBitmap.SetAttribute(
						imageindex=1,
						clientdata=null);
				endif;

				case styleno of

				/*named settings*/
				tblhdrno:
				{
					status = fld.SetAttribute(
						focusbehavior=FT_SETVALUE,
						bgdisplaypolicy=BDP_BORDEREDSCALED,
						height=$LVF_HEADERHEIGHT,
						clientdata=null);

					if fld.BgBitmap is not null then
						status = fld.BgBitmap.SetAttribute(
							cornerradius=0,
							clientdata=null);
					endif;
				}

				orangeno:
				{
					status = fld.SetAttribute(
						focusbehavior=FT_SETVALUE,
						clientdata=null);

					status = fld.BgBitmap.SetAttribute(
						cornerradius=2,		//check this
						clientdata=null);
				}

				/*topform & bottombar settings*/
				$FORM_FLD, $TAILBAR_FLD:
				{
					status = fld.SetAttribute(
						focusbehavior=FT_TABTO,
						clientdata=null);

					if fld.BgBitmap is not null then
						status = fld.BgBitmap.SetAttribute(
							cornerradius=3,
							clientdata=null);
					endif;
				}

				/*tablefield settings*/
				/*Not tableheader though - this was handled above
				*/
				$TBL_FLD:
				{
					status = fld.SetAttribute(
						/*no changes*/
						clientdata=null);
				}

				/*topbar settings*/
				/*  Store this button to use for mainbar settings
				*/
				$TOPBAR_FLD:
				{
					status = fld.SetAttribute(
						focusbehavior=FT_SETVALUE,
						clientdata=null);

					if fld.BgBitmap is not null then
						status = fld.BgBitmap.SetAttribute(
							cornerradius=2,	//check this value
							clientdata=null);
					endif;

					topbarbtn = fld;
				}
				default:
				{
					custom = FALSE;
				}
				endcase;
			}

			/*
			**  Apply entryfield settings
			*/
			'entryfield',
			'm_entryfield':
			{

				/*general settings*/
				status = fld.SetAttribute(
					outlinecolor=CC_BLUE,
					outlinestyle=OS_SOLID,
					outlinewidth=LW_MINIMUM,
					leftinnermargin=3,	//3 increases fieldwidth; maybe OK since font smaller
					rightinnermargin=3,
					topinnermargin=2,
					bottominnermargin=2,
					clientdata=null);

				if classname = 'm_entryfield' then
					status = fld.SetAttribute(
						topinnermargin=3,
						bottominnermargin=3,
						clientdata=null);
				endif;

				/*general bdp settings*/
				if fld.BgBitmap is not null then
					status = fld.SetAttribute(
						outlinewidth=LW_NOLINE,
						bgdisplaypolicy=BDP_CORNERED,
						bgpattern=FP_BITMAPCLEAR,
						bmpdisplaybehavior=BDB_OPAQUE,
						clientdata=null);

					status = fld.BgBitmap.SetAttribute(
						cornerradius=1,
						imageindex=1,
						clientdata=null);
				endif;

				/*context-specific settings*/
				/*(only those that apply are listed)
				*/
				case styleno of

				$TBL_FLD:
				{
					status = fld.SetAttribute(
						outlinewidth=LW_NOLINE,
						leftinnermargin=2,
						rightinnermargin=2,
						clientdata=null);
				}

				orangeno,
				$FORM_FLD,
				default:
				{
					custom = FALSE;
				}

				endcase;
			}

			/*
			**  Apply tablefield settings
			**
			**	Should be lvf-like, since it is almost the same visual
			**	interface in terms of roles, layout (lvf detail style)
			**	and facilities:
			**	- plain white tablebody, invisible single-pixel separators
			**	- gradiented highlighted tableheader
			**	- default single line darkgrey outline
			**	- fixed width and height
			*/
			'tablefield':
			{
				tbl = fld;
				lw = LW_MINIMUM;
				if tbl.OutlineWidth = LW_NOLINE and tbl.OutlineStyle = OS_SOLID then
					lw = LW_NOLINE;
				endif;

				/*general settings*/
				status = fld.SetAttribute(
					outlinecolor=$LVF_OUTLINECOLOR,
					outlinestyle=OS_SOLID,
					outlinewidth=lw,
					colseparatorstyle=LS_SOLID,
					colseparatorwidth=LW_MINIMUM,
					colseparatorcolor=tbl.BgColor,
					columnresizeable=TRUE,
					clientdata=null);

				status = tbl.TableBody.SetAttribute(
					bgcolor=tbl.BgColor,
					bgpattern=tbl.BgPattern,
					outlinecolor=tbl.OutlineColor,
					outlinestyle=OS_SOLID,
					outlinewidth=LW_NOLINE,
					clientdata=null);

				/*context-specific settings*/
				/*(only those that apply are listed)
				*/
				case styleno of
				default:
				{
					custom = FALSE;
				}
				endcase;
			}


			/*
			**  Apply subform settings
			**
			**	SubForms have a multitude of roles, especially
			**	now that we have SizeToParent and SizeToFrame
			**	and childmargin capabilities:
			**	- Business Object fixed-layout display
			**	- Labelled panel (GroupBox)
			**	- Right-align facilitator for mainbars and stacks
			**	- Spacer.
			**	It has also been used for fixed-alignment
			**	bgbitmap display.
			**	Detecting which of these roles existing subforms
			**	are filling, and places where it should be
			**	introduced (and in what form) is a complex issue
			**	for any conversion.
			*/
			'subform':
			{
				sub = fld;

				/*general settings*/
				/*(not child gravity, as need to preserve
				** current settings for layout purposes)
				*/
				status = fld.SetAttribute(
					outlinecolor=$LVF_OUTLINECOLOR,
					outlinestyle=OS_SOLID,
					outlinewidth=LW_NOLINE,
					childbottommargin=0,
					childleftmargin=0,
					childrightmargin=0,
					childtopmargin=0,
					sizetofit=STF_SELF,
					isbold=FALSE,	//for groupboxlabel
					clientdata=null);

				/*context-specific settings*/
				/*(only those that may apply are listed.
				** the strip style is for use where the subform
				** is providing right-align capability to mainbar)
				*/
				case styleno of

				groupboxno:
				{
					status = fld.SetAttribute(
						typefacename='segoe UI',
						outlinecolor=RGB(red=213,green=223,blue=229),
						groupboxlabel=' ',
						outlinestyle=OS_GROUPBOX,
						clientdata=null);
				}

				stripno:
				{
					status = fld.SetAttribute(
						sizetofit=STF_FRAME,
						clientdata=null);
				}

				btnbarno:
				{
					status = fld.SetAttribute(
						bgcolor=topform.BgColor,
						sizetofit=STF_FRAMEHORIZONTAL,
						height=229,
						clientdata=null);
				}

				$FORM_FLD,
				$TOPBAR_FLD,
				$TAILBAR_FLD,
				default:
				{
					custom = FALSE;
				}
				endcase;
			}

			/*
			**  Apply mainbar settings
			**
			*/
			'mainbar':
			{
				bar = fld;

				/*general settings*/
				status = fld.SetAttribute(
					outlinecolor=$LVF_OUTLINECOLOR,
					outlinestyle=OS_SOLID,
					outlinewidth=LW_NOLINE,
					childbottommargin=0,
					childleftmargin=0,
					childrightmargin=0,
					childtopmargin=0,
					bgcolor=topform.bgcolor,
					separatorcolor=fld.BgColor,
					separatorwidth=LW_NOLINE,
					sizetofit=STF_SELF,
					clientdata=null);

				/*general bdp settings for mainbars*/
				if fld.BgBitmap is not null then
					status = fld.SetAttribute(
						bgdisplaypolicy=BDP_CORNERED,
						bgpattern=FP_BITMAPCLEAR,
						bmpdisplaybehavior=BDB_OPAQUE,
						clientdata=null);

					status = fld.BgBitmap.SetAttribute(
						imageindex=1,
						clientdata=null);
				endif;

				/*context-specific settings*/
				/*(only those that may apply are listed.
				** the strip style is for use where the subform
				** is providing right-align capability to mainbar)
				*/
				case styleno of

				stripno:
				{
					/*TBD copy settings from topbarbtn sample if any*/
					/*insert copy of stripsub sample if any*/
				}

				$TOPBAR_FLD:
				{
					/*TBD copy settings from topbarbtn if any*/
				}

				$TAILBAR_FLD:
				{
				status = fld.SetAttribute(
					bgcolor=topform.BgColor,
					clientdata=null);
				}

				$FORM_FLD,
				default:
				{
					custom = FALSE;
				}
				endcase;
			}


			/*
			**  Apply tabfolder settings
			**
			**	Tabbar (and possibly tabfolder) backgrounds
			**	depend on the tabfolder's runtime parent,
			**	which could be working but is usually margin
			**
			**	Not currently applying any of the following tabbar
			**	settings (their default settings are preserved):
			**	- multitabstyle		//maybe preserve
			*/
			'tabfolder':
			{
				tbf = fld;

				/*general settings*/
				status = fld.SetAttribute(
					outlinecolor=$TBF_OUTLINECOLOR,
					outlinestyle=OS_SOLID,
					outlinewidth=LW_MINIMUM,
					isshadowed=TRUE,
					shadowcolor=CC_SYS_WINDOW,
					bgcolor=marginbgcolor,
					clientdata=null);

				status = tbf.TabBar.SetAttribute(
					outlinecolor=tbf.OutlineColor,
					outlinestyle=tbf.OutlineStyle,
					outlinewidth=tbf.OutlineWidth,
					tabbgcolor=workingbgcolor,
					normaltabcolor=RGB(red=225,green=225,blue=225),
					normaltextcolor=tbf.FgColor,
					typeface=trigger.TypeFace,
					typefacename=trigger.TypeFaceName,
					typesize=trigger.TypeSize,
					selectedtabcolor=CC_SYS_WINDOW,
					selectedtextcolor=tbf.FgColor,
					selectedtypeface=trigger.TypeFace,
					selectedtypefacename=trigger.TypeFaceName,
					selectedtypesize=trigger.TypeSize,
					shadowcolor=CC_SYS_WINDOW,
					tabshape=COR_BITMAPPED,
					tabgap=0,	//-1 looks good too
					separation=3,
					xmargin=4,
					ymargin=2,
					isfixedwidth=FALSE,
					displaytext=TRUE,
					displaybitmap=TRUE,
					bitmapposition=POS_CENTER,
					bgpattern=FP_BITMAP,
					clientdata=null);

				status = tbf.TabPageArray[1].SetAttribute(
					outlinecolor=tbf.OutlineColor,
					outlinestyle=OS_SOLID,
					outlinewidth=LW_NOLINE,
					bgcolor=workingbgcolor,
					bgpattern=tbf.BgPattern,
					fgcolor=tbf.FgColor,
					isreverse=tbf.IsReverse,
					typeface=common.TypeFace,
					typefacename=common.TypeFaceName,
					typesize=common.TypeSize,
					requirerealfield=TRUE,
					clientdata=null);

				tab = tbf.TabBar.TabFieldArray[1];
				status = tab.SetAttribute(
					hasbitmap=TRUE,
					clientdata=null);

				/*context-specific settings*/
				/*(only those that apply are listed)
				*/
				case styleno of
				default:
				{
					custom = FALSE;
				}
				endcase;
			}

			/*
			**  Apply frameform settings
			*/
			'frameform':
			{

				/*general settings*/
				status = fld.SetAttribute(
					clientdata=null);

				/*context-specific settings*/
				/*(only those that apply are listed)
				*/
				case styleno of
				$FORM_FLD:
				{
					topform = fld;
					status = fld.SetAttribute(
						bgcolor=marginbgcolor,
						clientdata=null);
				}

				default:
				{
					custom = FALSE;
				}

				endcase;

			}


			/*
			**  Apply other wrapper-composite settings
			*/
			'stackfield',
			'matrixfield',
			'flexibleform':
			{

				/*general settings*/
				status = fld.SetAttribute(
					outlinecolor=$LVF_OUTLINECOLOR,
					outlinestyle=OS_SOLID,
					outlinewidth=LW_NOLINE,
					clientdata=null);


				/*context-specific settings*/
				/*(only those that apply are listed)
				*/
				case styleno of
				default:
				{
					custom = FALSE;
				}
				endcase;

			}

			/*
			**  Apply rectangleshape settings
			*/
			'rectangleshape':
			{
				/*general settings*/
				status = fld.SetAttribute(
					linewidth=LW_NOLINE,
					bgpattern=FP_CLEAR,
					clientdata=null);

				/*context-specific settings*/
				/*(only those that apply are listed)
				*/
				case styleno of
				default:
				{
					custom = FALSE;
				}
				endcase;
			}

			/*
			**  Apply freetrim settings
			*/
			'freetrim':
			{
				/*general settings*/
				status = fld.SetAttribute(
					bgpattern=FP_CLEAR,
					clientdata=null);

				/*context-specific settings*/
				/*(only those that apply are listed)
				*/
				case styleno of
				default:
				{
					custom = FALSE;
				}
				endcase;
			}


			/*
			**  Apply controlbutton settings
			*/
			'controlbutton':
			{
				/*general settings*/
				status = fld.SetAttribute(
					outlinewidth=LW_NOLINE,				//this may be ignored
					bgcolor=$IMAGE_BGCOLOR,
					outlinecolor=$IMAGE_BGCOLOR,
					fgcolor=$IMAGE_FGCOLOR,
					bitmaplabel=fld.BgBitmap,
					clientdata=null);

				if tbl is not null then
					ctbl = tbl;
				else
					tbl = fld.WhichTableField();		//probably null
				endif;
				if tbl is not null then
					status = fld.SetAttribute(
						bgcolor=tbl.BgColor,
						outlinecolor=tbl.BgColor,
						clientdata=null);
				endif;

				/*context-specific settings*/
				/*(only those that apply are listed)
				*/
				case styleno of
				default:
				{
					custom = FALSE;
				}
				endcase;
			}

			/*
			**  Apply imagefield settings
			**	(only for monochrome images)
			*/
			'imagefield', 'imagetrim':
			{
				/*general settings*/
				status = fld.SetAttribute(
					outlinewidth=LW_NOLINE,
					bgcolor=$IMAGE_BGCOLOR,
					outlinecolor=$IMAGE_BGCOLOR,
					fgcolor=$IMAGE_FGCOLOR,
					clientdata=null);

				/*context-specific settings*/
				/*(only those that apply are listed)
				*/
				case styleno of
				default:
				{
					custom = FALSE;
				}
				endcase;
			}

			default:
			{
				custom = FALSE;
			}
			endcase;

			/*
			**  Adjust count of styles to include this one
			**  ..if it is customized and the count is low
			*/
			if custom = TRUE and k < styleno then
				k = styleno;
			endif;

		endfor;

		/*
		**  Remove superfluous stylefields
		*/
		for j = fields.LastRow downto k+1 do
			fields[j].ParentField = null;
		endfor;
		mat.rows = k;
	endfor;

	/*
	**  Store mainbar settings as a taggedvalue & remove the mainbar matrix
	**  ..if we still dont directly support mainbar styling
	*/
	if mainbaradded = TRUE then
		stylesheet[1].SetTaggedValue(tag='mainbarstyle', item=mainbarmat);
		stylesheet.RemoveRow(rownumber=stylesheet.LastRow);
	endif;

	return status;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**  Copy the provided bitmaps to the field entries to which they belong
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**  We have to do this the hard way, as only some fields will
**  have bitmaps.
*/
procedure LoadFieldBitmaps(

	stylesheet		= array of FormField default null;

)=
declare
	rc		= integer not null default ER_OK;
	i		= integer not null;
	j		= integer not null;
	k		= integer not null;
	ident		= varchar(32) not null default '';
	orangeno	= integer not null;
	tblhdrno	= integer not null;
	stripno		= integer not null;
	groupboxno	= integer not null;
	fldsample	= FormField default null;
	fld		= FormField default null;
	offfld		= FormField default null;
	onfld		= FormField default null;
	barfld		= FormField default null;
	hifld		= FormField default null;
	tab		= TabField default null;
	name		= varchar(256) not null default '';
enddeclare
{
	/*
	**  Traverse all the stylefields (backwards within each field class)
	*/
	for i = 1 to stylesheet.LastRow do
		mat = stylesheet[i];
		classname = mat.ClientText;

		if classname = '' then
			continue;
		endif;
		if mat.ChildFields.LastRow = 0 then
			continue;
		endif;

		fldsample = mat.ChildFields[1];

		/*
		**  Distinguish between single and multiline entryfields
		*/
		if classname != 'entryfield' then
		elseif EntryField(fldsample).IsMultiline = TRUE then
			classname= 'm_entryfield';
		endif;

		/*
		**  Get this field-type's stylenos (if any) for the named styles
		*/
		orangeno = W7.StyleIndexFromName(fld=fldsample, stylename='w7orange');
		tblhdrno = W7.StyleIndexFromName(fld=fldsample, stylename='w7tblheader');
		stripno = W7.StyleIndexFromName(fld=fldsample, stylename='w7strip');
		groupboxno = W7.StyleIndexFromName(fld=fldsample, stylename='w7groupbox');

		for j = 8 downto 1 do

			fld = null;
			offfld = null;
			onfld = null;

			/*
			**  Determine if we have a bitmap for this field
			*/
			if j = orangeno then
				ident = 'w7orange';
			elseif j = tblhdrno then
				ident = 'w7tblheader';
			elseif j = stripno then
				ident = 'w7strip';
			elseif j = groupboxno then
				ident = 'w7groupbox';
			else
				ident = varchar(j);
			endif;

			name=classname + '_' + ident + '_bitmap';
			fld = curframe.TopForm.FieldByName(name=name);

			if classname = 'tabfolder' then
				tab = TabFolder(mat.ChildFields[1]).TabPageArray[1].TabField;
				name = classname + '_' + ident + '_normalbitmap';
				offfld = curframe.TopForm.FieldByName(name=name);
				name = classname + '_' + ident + '_selectedbitmap';
				onfld = curframe.TopForm.FieldByName(name=name);
				name = classname + '_' + ident + '_highlightbitmap';
				hifld = curframe.TopForm.FieldByName(name=name);
				name = classname + '_' + ident + '_barbitmap';
				barfld = curframe.TopForm.FieldByName(name=name);
			endif;

			if fld is null and offfld is null and onfld is null then
				continue;
			endif;

			/*
			**  Ensure we have a field for this bitmap
			**  (copy the first stylefield of the class if needed)
			*/
			for k = mat.ChildFields.LastRow + 1 to j do
				mat.Rows = j;	//ensures it gets set only if needed
				mat.InsertChild(
					row=k, fieldtoinsert=fldsample.Duplicate());
			endfor;

			/*
			**  Attach a copy of the bitmap to the field
			*/
			if fld is not null then
				mat.ChildFields[j].BgBitmap = fld.BgBitmap.Duplicate();
			endif;
			if offfld is not null and classname = 'tabfolder' then
				tab.NormalBitmap = offfld.BgBitmap.Duplicate();
			endif;
			if onfld is not null and classname = 'tabfolder' then
				tab.SelectedBitmap = onfld.BgBitmap.Duplicate();
			endif;
			if hifld is not null and classname = 'tabfolder' then
				tab.BgBitmap = hifld.BgBitmap.Duplicate();
			endif;
			if barfld is not null and classname = 'tabfolder' then
				TabFolder(mat.ChildFields[1]).TabBar.BgBitmap =
					barfld.BgBitmap.Duplicate();
			endif;
		endfor;
	endfor;

	return rc;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**  Set up progress messages
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure SetupProgressMessages(

	frame		= FrameSource default null;

)=
declare
	msg = varchar(256) not null default '';
	suffix = varchar(256) not null default '';
	tag = varchar(32) not null default '';
enddeclare
{
	frametype = Lowercase(frame.ClassName);
	suffix = frametype + ' "' + frame.Name + '"';

	tag = 'pulse';
	msg = $t + 'Applying pulse settings to ' + suffix;
	$SETMSG(tag=tag, textvalue=msg);

	tag = 'entry';
	msg = $t + 'Applying focus and mouseover settings to ' + suffix;
	$SETMSG(tag=tag, textvalue=msg);

	tag = 'tbl';
	msg = $t + 'Applying tablefield settings to ' + suffix;
	$SETMSG(tag=tag, textvalue=msg);

	tag = 'tabfolder';
	msg = $t + 'Applying tabfolder settings to ' + suffix;
	$SETMSG(tag=tag, textvalue=msg);

	tag = 'copyframe';
	msg = $t + 'Copying the frame-level settings to ' + suffix;
	$SETMSG(tag=tag, textvalue=msg);

	tag = 'namedstyles';
	msg = $t + 'Setting up named styles "w7orange" and "w7tblheader" in the relevant stylesheet fields in ' + suffix;
	$SETMSG(tag=tag, textvalue=msg);

	tag = 'copybitmaps';
	msg = $t + 'Copying the bitmaps to the individual stylesheet fields in ' + suffix;
	$SETMSG(tag=tag, textvalue=msg);

	tag = 'copytags';
	msg = $t + 'Copying the tagged values to the individual stylesheet fields in ' + suffix;
	$SETMSG(tag=tag, textvalue=msg);

	tag = 'stylesettings';
	msg = $t + 'Applying  settings to individual stylesheet fields in ' + suffix;
	$SETMSG(tag=tag, textvalue=msg);

	return ER_OK;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**  Apply style settings to individual stylefields
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
procedure SetupNamedStyles(

	stylesheet		= array of FormField default null;

)=
declare
	classname		= varchar(32) not null;
	i			= integer not null;
	fields			= array of FormField default null;
	fldsample		= FormField default null;
	orangeno		= integer not null default 0;
	tblhdrno		= integer not null default 0;
	stripno			= integer not null default 0;
	groupboxno		= integer not null default 0;
	btnbarno		= integer not null default 0;
	orangedesc		= varchar(256) not null default
		'Windows 7 orange highlighting; see for example Visual Studio 2010';
	tblhdrdesc		= varchar(256) not null default
		'Windows 7 column header styling for ListView fields';
	stripdesc		= varchar(256) not null default
		'Windows 7 toolbar strip styling using subforms with STK_FRAME';
	groupboxdesc		= varchar(256) not null default
		'Windows 7 groupbox styling using subforms with OS_GROUPBOX';
	btnbardesc		= varchar(256) not null default
		'Windows 7 buttonbar styling using subforms with STF_FRAMEHORIZONTAL';
enddeclare
{
	/*
	**  Process each field class in turn;
	**  Use a copy of the first stylefield as a sample
	*/
	for i = 1 to stylesheet.LastRow do
		classname = stylesheet[i].ClientText;
		stylesheet[i].GetAttribute(childfields=Byref(fields));

		if classname = '' then
			continue;
		endif;
		if fields.LastRow = 0 then
			continue;
		endif;

		fldsample = fields[1].Duplicate();

		/*
		**  Distinguish between single and multiline entryfields
		*/
		if classname != 'entryfield' then
		elseif EntryField(fldsample).IsMultiline = TRUE then
			classname= 'm_entryfield';
		endif;

		/*
		**  Get the field index for any named styles that involve this
		**  field type
		*/
		case classname of

		'buttonfield',
		'entryfield',
		'optionfield':
		{
			orangeno = $TOPBAR_ORANGE_STYLENO;
			tblhdrno = $TBL_HDR_STYLENO;
		}

		'subform':
		{
			stripno = $DISPLAY_STRIP_STYLENO;
			groupboxno = $FORM_GROUPBOX_STYLENO;
			btnbarno = $FORM_BTNBAR_STYLENO;
		}

		default:
		{
			orangeno = 0;
			tblhdrno = 0;
			stripno = 0;
			groupboxno = 0;
		}

		endcase;

		/*
		**  Setup the entries as named style entries ..if appropriate
		*/
		if orangeno > 0 then
			rc = w7.ClassifyStyleField(
				fld = fldsample,
				styleindex=orangeno,
				stylename='w7orange',
				comment=ToString(text=orangedesc));
		endif;
		if tblhdrno > 0 then
			rc = w7.ClassifyStyleField(
				fld = fldsample,
				styleindex=tblhdrno,
				stylename='w7tblheader',
				comment=ToString(text=tblhdrdesc));
		endif;
		if stripno > 0 then
			rc = w7.ClassifyStyleField(
				fld = fldsample,
				styleindex=stripno,
				stylename='w7strip',
				comment=ToString(text=stripdesc));
		endif;
		if groupboxno > 0 then
			rc = w7.ClassifyStyleField(
				fld = fldsample,
				styleindex=groupboxno,
				stylename='w7groupbox',
				comment=ToString(text=groupboxdesc));
		endif;
		if btnbarno > 0 then
			rc = w7.ClassifyStyleField(
				fld = fldsample,
				styleindex=btnbarno,
				stylename='w7btnbar',
				comment=ToString(text=btnbardesc));
		endif;
	endfor;

	return rc;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**  Insert missing style classes temporarily into the stylesheet array
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	The style matrixfields for these (currently frameform and mainbar)
**	are stored in taghash entries in the first stylesheet matrixfield
**	(barfield, as it happens). To simplify the style processing, we
**	temporarily add them to start and end respectively of the array.
*/
procedure AddMissingStyleClasses(

	stylesheet		= array of FormField default null;

)=
declare
	ff			= FrameForm;
	mb			= MainBar;
	formmat			= MatrixField default null;
	mainbarmat		= MatrixField default null;
	ffattached		= integer not null default FALSE;
	mbattached		= integer not null default FALSE;
enddeclare
{

	/*
	**  Access the topform style matrix in the stylesheet, creating it if necessary;
	*/
	if stylesheet.Find(attributename='clienttext', value='frameform') != ER_OK then
		ffattached = TRUE;
		w7.GetFieldFromStyleSheet(f=ff, mat=Byref(formmat));
	endif;

	/*
	**  Access the mainbar stylefields in the stylesheet, creating them if necessary;
	*/
	if stylesheet.Find(attributename='clienttext', value='mainbar') != ER_OK then
		mbattached = TRUE;
		w7.GetFieldFromStyleSheet(f=mb, mat=Byref(mainbarmat));
	endif;

	/*
	**  Add them temporarily to the stylesheet array ..if they arent there
	**
	**  We do this *after* calling GetFieldFromStyleSheet for both frameform
	**  and mainbar, as GetFieldFromStyleSheet looks at stylesheet[1],
	**  which would change if formmat was inserted at the top of the array.
	**  Just to be sure, we insert it at position 2 instead - entry 1 is
	**  barfield, which has no interest in the frameform settings.
	*/
	if ffattached = TRUE then
		stylesheet.InsertRow(rowobject=formmat, rownumber=2);
	endif;
	if mbattached = TRUE then
		stylesheet.InsertRow(rowobject=mainbarmat, rownumber=stylesheet.LastRow+1);
	endif;

	return ffattached + 2*mbattached;
}



/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**  Remove the temporarily-added style classes from the stylesheet array
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	See header for ApplyMissingStyleClasses
**
*/
procedure RemoveMissingStyleClasses(

	stylesheet		= array of FormField default null;
	added			= integer not null default 0;

)=
declare
	ff			= FrameForm;
	mb			= MainBar;
	formmat			= MatrixField default null;
	mainbarmat		= MatrixField default null;
	ffattached		= integer not null default FALSE;
	mbattached		= integer not null default FALSE;
enddeclare
{
	/*
	**  Remove the topform matrix entry from the array
	**  ..if it was added
	*/
	if Mod(added,2) = TRUE
	and stylesheet.Find(attributename='clienttext', value='frameform',
			rownumber=Byref(indx)) = ER_OK then
		stylesheet.RemoveRow(rownumber=indx);
	endif;

	/*
	**  Remove the topform matrix entry from the array
	**  ..if it was added
	*/
	if added/2 = TRUE
	and stylesheet.Find(attributename='clienttext', value='mainbar',
			rownumber=Byref(indx)) = ER_OK then
		stylesheet.RemoveRow(rownumber=indx);
	endif;

	return ER_OK;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**  Copy the provided taggedvalues to the field entries to which they belong
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
*/
procedure LoadFieldTaggedValues(

	stylesheet		= array of FormField default null;

)=
declare
	IE		= InputEvent;
	response_sel	= StringObject;
	response_nor	= StringObject;
	eventkey	= varchar(32) not null;
	mat		= MatrixField default null;
	fields		= array of FormField default null;
	i		= integer not null;
	j		= integer not null;
	classname	= varchar(65) not null;
	tbf		= TabFolder default null;
	tbar		= TabBar default null;
	tpage		= TabPage default null;
	tab		= TabField default null;
enddeclare
{
	/*
	**  Process each field class in turn
	**  (For now we are only applying to tabfolders, and only to fieldstyle 1)
	*/
	for i = 1 to stylesheet.LastRow do
		mat = stylesheet[i];
		classname = mat.ClientText;
		fields = mat.ChildFields;

		if classname = '' then
			continue;
		endif;
		if fields.LastRow = 0 then
			continue;
		endif;

		case classname of
		'tabfolder':
		{

			/*
			**  tabfolder - no tagged values for tabfolder itself
			*/
			tbf = fields[1];	//first fieldstyle only

			/*
			**  tabpage - no tagged values for tabpage
			*/
			tpage = tbf.TabPageArray[1];

			/*
			**  tabbar:
			**  - set inputevent_enabled tag to trigger IE responses;
			**  - set mouseover event responses triggered against
			**    individual tabfields (must be defined in tabbar
			**    because tabfields are not themselves realfields)
			*/
			tbar = tbf.TabBar;

			tbar.SetTaggedValue(tag='inputevent_enabled');

			response_sel.Value = '2';
			response_nor.Value = '1';

			eventkey = IE.EventKey(
				action=IE_MOUSEENTER, modifierkey=KB_NONE, responsecode=RE_MOUSEENTERTAB);
			IE.LoadEventBehavior(
				location=tbar, eventkey=eventkey,
				responsetype='event_responses',
				response=response_sel,
				ispermanent=TRUE, locationinsource=TRUE);

			eventkey = IE.EventKey(
				action=IE_MOUSEEXIT, modifierkey=KB_NONE, responsecode=RE_MOUSEEXITTAB);
			IE.LoadEventBehavior(
				location=tbar, eventkey=eventkey,
				responsetype='event_responses',
				response=response_nor,
				ispermanent=TRUE, locationinsource=TRUE);


			response_sel = response_sel.Duplicate();
			response_nor = response_nor.Duplicate();
			response_sel.Value = '3';
			response_nor.Value = '4';

			eventkey = IE.EventKey(
				action=IE_MOUSEENTER, modifierkey=KB_NONE,
				responsecode=RE_MOUSEENTERSELTAB);
			IE.LoadEventBehavior(
				location=tbar, eventkey=eventkey,
				responsetype='event_responses',
				response=response_sel,
				ispermanent=TRUE, locationinsource=TRUE);

			eventkey = IE.EventKey(
				action=IE_MOUSEEXIT, modifierkey=KB_NONE, responsecode=RE_MOUSEEXITSELTAB);
			IE.LoadEventBehavior(
				location=tbar, eventkey=eventkey,
				responsetype='event_responses',
				response=response_nor,
				ispermanent=TRUE, locationinsource=TRUE);

			/* tabfield - no tagged values for tabfield */
			tab = tbf.TabBar.TabFieldArray[1];
		}

		default:	;
		endcase;

	endfor;

	return ER_OK;
}

