/*Context constants - contextno and styleno*/
#define $FORM_FLD		'1'
#define $TOPBAR_FLD		'2'
#define $TAILBAR_FLD		'3'
#define $TBL_FLD		'4'
#define $MENU_FLD		'99'
#define $DISPLAY_FLD		'9'	-- for completeness; not used

/*Named style constants - contextno*/
#define $TBL_HDR_FLD		'41'
#define $TOPBAR_ORANGE_FLD	'21'
#define $FORM_GROUPBOX_FLD	'11'
#define $DISPLAY_STRIP_FLD	'91'
#define $FORM_BTNBAR_FLD	'71'

/*Named style constants - styleno*/
#define $TBL_HDR_STYLENO	'5'	--"w7tblheader": buttonfields only
#define $TOPBAR_ORANGE_STYLENO	'6'	--"w7orange": buttonfields, entryfields
#define $DISPLAY_STRIP_STYLENO	'5'	--"w7strip": subforms only
#define $FORM_GROUPBOX_STYLENO	'6'	--"w7groupbox": subforms only
#define $FORM_BTNBAR_STYLENO	'7'	--"w7buttonbar": subforms only

#define $ICON_BMP_WIDTH		'24'
#define $ICON_BMP_HEIGHT	'24'

/*Miscellaneous*/
#define $INFO			'curmethod.Trace'
#define $WARN			'$INFO'

/*
**@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
**				METHODS
**@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
*/

/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Apply the styling to the passed field
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
/*
**	Gets the model field of this class and styleindex from the stylesheet,
**	and applies the standard style properties from it to the target field.
**
**	Allows for fieldtypes not in the stylesheet: mainbar and frameform
**	are stored as stylesheet[1] tagged items.
**	If there is no entry for the specified styleindex, it uses the default
**	(styleindex=1) model.
*/
method ApplyStyleToField(

	targetfield		= FieldObject default null;	//may be byref - tbl headers with freetrim need to switch to buttons
	styleindex		= integer not null default 1;
	modelfield		= FormField default null;	//for byref return

)=
declare
	rc			= integer not null default ER_OK;
	lookupfield		= FormField default null;
	tblhdrbtn		= ButtonField default null;
	stac			= StackField default null;
	indx			= integer not null default 0;
enddeclare
{
	lookupfield = targetfield;

	modelfield = curobject.GetFieldFromStyleSheet(
		f=lookupfield, styleindex=styleindex);

	if modelfield is null then
		$WARN('No style model for ' + targetfield.ClassName +
			', index ' + varchar(styleindex) +
			'. Defaulting to style 1.');
		styleindex = 1;
		modelfield = curobject.GetFieldFromStyleSheet(
			f=lookupfield, styleindex=styleindex);
	endif;

	if modelfield is null then
		$WARN('No style model for ' + targetfield.ClassName + ', index ' + varchar(styleindex));
		return ER_FAIL;
	endif;

	if modelfield.IsA(class=TableField) = TRUE then
		curobject.TableStyleAttributes.GetStyleAttributes(t=modelfield);
		curobject.TableStyleAttributes.ApplyStyleAttributes(
			t=targetfield, change_bias=FALSE);

	elseif modelfield.IsA(class=TabFolder) = TRUE then
		curobject.TabStyleAttributes.GetTabFolderStyleAttributes(t=modelfield);
		curobject.TabStyleAttributes.ApplyTabFolderStyleAttributes(
			t=targetfield, change_bias=FALSE);

	else
		curobject.StyleAttributes.GetStyleAttributes(f=modelfield);
		curobject.StyleAttributes.ApplyStyleAttributes(
			f=targetfield, change_bias=FALSE);
	endif;

	return rc;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Get the style field for a specific field type and styleindex
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	Also returns byref the matrix for the fieldclass
*/
method GetFieldFromStyleSheet(

	f			= FieldObject default null;
	styleindex		= integer not null default 1;
	original		= integer not null default FALSE;
	mat			= MatrixField default null;

)=
declare
	classname		= varchar(65) not null;
	stylesheet		= array of FormField default null;
	mf			= FormField default null;
	indx			= integer not null default 0;
	rc			= integer not null default ER_OK;
enddeclare
{
	classname = Lowercase(f.ClassName);

	if curobject.StyleSheet is null then
		return null;
	endif;

	if curobject.StyleSheet.LastRow < 1 or styleindex < 1 then
		return null;
	endif;

	/*
	**  Find the matrix containing the style fields for this field type;
	*/
	rc = curobject.StyleSheet.Find(
		attributename='clienttext', value=classname,
		rownumber=Byref(indx));


	if rc != ER_OK then
		/*
		**  Use special handling for topform, until there is full provision for it
		**  (create the entry if it doesnt exist, since this will act as
		**  location for all the event_responses behaviour definitions)
		*/
		if classname = 'frameform' then
			mat = null;
			curobject.StyleSheet[1].FetchTaggedValue(
				tag='styleclass&frameform', item=Byref(mat));

			if mat is null then
				mat = MatrixField.Create();
				mat.SetAttribute(
					clienttext='frameform', rows=1, columns=1);
				mat.InsertChild(fieldtoinsert=FrameForm.Create());
				curobject.StyleSheet[1].SetTaggedValue(
					tag='styleclass&frameform', item=mat);
			endif;

		/*
		**  Use special handling for mainbar, until there is full provision for it
		*/
		elseif classname = 'mainbar' then
			mat = null;
			curobject.StyleSheet[1].FetchTaggedValue(
				tag='styleclass&mainbar', item=Byref(mat));

			if mat is null then
				mat = MatrixField.Create();
				mat.SetAttribute(
					clienttext='mainbar', rows=1, columns=1);
				mat.InsertChild(fieldtoinsert=MainBar.Create());
				curobject.StyleSheet[1].SetTaggedValue(
					tag='styleclass&mainbar', item=mat);
			endif;

		else
			return null;
		endif;
	endif;

	if mat is null then
		mat = curobject.StyleSheet[indx];
	endif;

	/*
	**  Get and return the stylefield corresponding to the specified index
	*/
	if styleindex > mat.ChildFields.LastRow then
		return null;
	endif;

	mf = mat.ChildFields[styleindex];
	if original = FALSE then
		mf = mf.Duplicate();
	endif;

	return mf;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Get the styleindex for a named style
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	OpenROAD uses numbered fields in the stylesheet, assuming that only
**	one style is represented or required, and that the need for alternative
**	visualizations of a given fieldtype will be so occasional as to justify
**	the need for developers to apply them by hand (by changing the field's
**	fieldstyle).
**	However this is not the case - topform buttons need different styling
**	to toolbar buttons, for example, and styles are often domain-specific
**	rather than fieldtype-specific.
**	CSS stylesheets address this by allowing cascading overlay of
**	stylesheets (which OpenROAD cannot do), and definition of multiple
**	style classes within a stylesheet: this OpenROAD can do, if names can
**	be associated with stylesheet entries, preferably multiple names.
**	To do this requires a pair of methods, one to link specific stylesheet
**	entries to classnames, the other (this method) to find the field of
**	a specified type that is associated with a specified classname.
*/
method StyleIndexFromName(

	fld			= FormField default null;
	stylename		= varchar(32) not null default '';
	comment			= StringObject default null;

)=
declare
	tfld			= FormField default null;
	mat			= MatrixField default null;
	rc			= integer not null default ER_OK;
	indx			= integer not null;
	i			= integer not null;
enddeclare
{
	rc = curobject.StyleSheet.Find(
		attributename='clienttext', value=Lowercase(fld.ClassName),
		rownumber=Byref(indx));
	if rc != ER_OK then
		return -1;
	endif;

	mat = curobject.StyleSheet[indx];
	for i = 1 to mat.ChildFields.LastRow do
		tfld = mat.ChildFields[i];
		tfld.FetchTaggedValue(tag='stylename&'+stylename, item=Byref(comment));
		if comment is not null then
			return i;
		endif;
	endfor;

	return 0;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Associate a stylesheet field with a named style
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	This is one of a pair of methods to enable named styles. See the
**	companion method StyleIndexFromName for details.
*/
method ClassifyStyleField(

	fld			= FormField default null;
	fldsample		= FormField default null;
	fields			= array of FormField default null;
	styleindex		= integer not null default 1;
	stylename		= varchar(32) not null default '';
	comment			= StringObject;
)=
declare
	mat			= MatrixField default null;
	stylefield		= FormField default null;
	rc			= integer not null default ER_OK;
	indx			= integer not null;
	i			= integer not null;
enddeclare
{
	rc = curobject.StyleSheet.Find(
		attributename='clienttext', value=Lowercase(fld.ClassName),
		rownumber=Byref(indx));
	if rc != ER_OK then
		return -1;
	endif;

	mat = curobject.StyleSheet[indx];
	fields = mat.ChildFields;
	fldsample = fields[1].Duplicate();

	for i = fields.LastRow+1 to styleindex do
		mat.Rows = i;
		mat.InsertChild(row=i, fieldtoinsert=fldsample.Duplicate());
	endfor;

	stylefield = mat.ChildFields[styleindex];

	rc = stylefield.SetTaggedValue(
		tag='stylename&'+stylename, item=comment);

	return rc;
}



/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Get the frame context of this field
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	This is not returning the styleindex, it is returning an enumerated
**	context (form, top bars, other bars, tablefield, specials). The first
**	four of these have enumerations that match the styleindex (so form
**	fields are defined by styleindex 1, topbar fields by styleindex 2,
**	etc; the specials have 2-digit enumerations where the first digit
**	(1-4) matches the main context, the second provides uniqueness.
**	For example, Windows 7 styling has 2 special contexts, w7orange (21)
**	and w7tblheader (41) - the 2 and 4 indicate topbar and tbl respectively.
**	Currently these map to styleindex 5 and 6 respectively for all field
**	types, but this may change, and they may in future map differently
**	for different field types.
*/
method GetFieldContext(

	targetfield		= FieldObject default null;
	targetframe		= FrameSource default null;

)=
declare
	fld			= FormField default null;
	frame			= FrameSource default null;
	pfld			= FormField default null;
	tbl			= TableField default null;
	intblhdr		= integer not null default FALSE;
enddeclare
{
	fld = targetfield;
	frame = targetframe;

	/*
	**  Deal with menu fields
	*/
	if targetfield.IsA(class=MenuField) = TRUE then
		return $MENU_FLD;
	endif;

	/*
	**  Deal with fields within tablefields;
	**  Distinguish header fields from body fields
	*/
	tbl = targetfield.WhichTableField();
	if tbl is not null then
		if fld.IsDescendantOf(ancestor=tbl.TableHeader) = TRUE then
			intblhdr = TRUE;
		endif;
	endif;

	if intblhdr = FALSE then
		if tbl is not null then
			return $TBL_FLD;
		endif;
	elseif fld.IsA(class=StackField) = TRUE then
		return $TBL_HDR_FLD;
	else
		return $TBL_HDR_FLD;
	endif;

	/*
	**  Deal with other fields within topform
	*/
	if fld.IsDescendantOf(ancestor=frame.TopForm) = TRUE then
		return $FORM_FLD;
	endif;

	/*
	**  Deal with fields within mainbars
	**
	**  Distinguish topbar fields from other fields; treat bottom, left
	**  and right the same
	*/
	pfld = fld;
	while pfld.ParentField is not null do
		pfld = pfld.ParentField;
	endwhile;

	if frame.MainBarTop.Find(attributename='instanceidentifier',
		value=pfld.InstanceIdentifier) = ER_OK then
		return $TOPBAR_FLD;
	endif;

	return $TAILBAR_FLD;
}

