/*
**
**  Name:	tabfolder_style_attributes
**
**  Description:
**	Apply stylesheet tabfolder settings to the passed field
**
**	This does not provide custom settings for the following tabbar
**	properties at present,but may need to later:
**		bitmapposition
**		multitabstyle
