**
**  History:
**
**	25-aug-2014 (thrse01)
**	    Adapted from internal tablefield_style_attributes.
**	27-nov-2014 (thrse01) Bug 129591
**		Provide tab w7 appearance and mouseover highlighting.
*/

method GetTabFolderStyleAttributes
(
	t		= TabFolder default null;
)=
declare
	tb		= TabBar default null;
	tp		= TabPage default null;
	tf		= TabField default null;

	t_b		= $_ComponentName default null;
	t_p		= $_ComponentName default null;
	t_f		= $_ComponentName default null;
enddeclare
{
	if curobject.tab_folder is null then
		curobject.tab_folder = $_ComponentName.Create();
		curobject.tab_bar = $_ComponentName.Create();
		curobject.tab_page = $_ComponentName.Create();
		curobject.tab_field = $_ComponentName.Create();
	endif;

	tb = t.TabBar;

	tp = t.TabPageArray[1];	//just apply page 1 settings
	tf = tp.TabField;

	t_b = curobject.tab_bar;
	t_p = curobject.tab_page;
	t_f = curobject.tab_field;

	CurObject.tab_folder.GetStyleAttributes(f = t);
	CurObject.tab_bar.GetStyleAttributes(f = tb);

	CurObject.tab_page.GetStyleAttributes(f = tp);
	CurObject.tab_field.GetStyleAttributes(f = tf);

	t.GetAttribute(
		isshadowed=Byref(curobject.tab_folder.isshadowed),
		shadowcolor=Byref(curobject.tab_folder.shadowcolor),
		tagged_values=Byref(curobject.TaggedValues),
		clientdata=null);

	tb.GetAttribute(
		tabbgcolor=Byref(t_b.tabbgcolor),
		normaltabcolor=Byref(t_b.normaltabcolor),
		normaltextcolor=Byref(t_b.normaltextcolor),
		normaltypeface=Byref(t_b.normaltypeface),
		normaltypefacename=Byref(t_b.normaltypefacename),
		normaltypesize=Byref(t_b.normaltypesize),
		selectedtabcolor=Byref(t_b.selectedtabcolor),
		selectedtextcolor=Byref(t_b.selectedtextcolor),
		selectedtypeface=Byref(t_b.selectedtypeface),
		selectedtypefacename=Byref(t_b.selectedtypefacename),
		selectedtypesize=Byref(t_b.selectedtypesize),
		shadowcolor=Byref(t_b.shadowcolor),
		tabshape=Byref(t_b.tabshape),
		tabgap=Byref(t_b.tabgap),	//-1 looks good too
		separation=Byref(t_b.separation),
		xmargin=Byref(t_b.xmargin),
		ymargin=Byref(t_b.ymargin),
		isfixedwidth=Byref(t_b.isfixedwidth),
		displaytext=Byref(t_b.displaytext),
		displaybitmap=Byref(t_b.displaybitmap),
		bitmapposition=Byref(t_b.BitmapPosition),
		bgbitmap=Byref(t_b.BgBitmap),
		tagged_values=Byref(t_b.TaggedValues),
		clientdata=null);

	tp.GetAttribute(
		outlinecolor=Byref(t_p.OutlineColor),
		outlinestyle=Byref(t_p.OutlineStyle),
		outlinewidth=Byref(t_p.OutlineWidth),
		bgcolor=Byref(t_p.BgColor),
		bgpattern=Byref(t_p.BgPattern),
		fgcolor=Byref(t_p.FgColor),
		isreverse=Byref(t_p.IsReverse),
		typeface=Byref(t_p.TypeFace),
		typefacename=Byref(t_p.TypeFaceName),
		typesize=Byref(t_p.TypeSize),
		taggedvalues=Byref(t_p.TaggedValues),
		clientdata=null);

	tf.GetAttribute(
		normalbitmap=Byref(t_f.NormalBitmap),
		selectedbitmap=Byref(t_f.SelectedBitmap),
		bgbitmap=Byref(t_f.BgBitmap),
		hasbitmap=Byref(t_f.HasBitmap),
		tagged_values=Byref(t_f.TaggedValues),
		clientdata=null);

}



method ApplyTabFolderStyleAttributes
(
	t			= TabFolder,
	change_bias		= integer not null default TRUE,
	honor_unique_style	= integer not null default FALSE
) =
declare
	pf		= formfield;
	tb		= TabBar default null;
	tp		= TabPage default null;
	tf		= TabField default null;
	t_b		= $_ComponentName default null;
	t_p		= $_ComponentName default null;
	t_f		= $_ComponentName default null;
	form		= compositefield default null;
	status		= integer not null default FALSE;
	f		= formfield default null;
	i		= integer not null;
enddeclare
{

	if curobject.tab_folder is null then
		curobject.tab_folder = $_ComponentName.Create();
		curobject.tab_bar = $_ComponentName.Create();
		curobject.tab_page = $_ComponentName.Create();
		curobject.tab_field = $_ComponentName.Create();
	endif;

	tb = t.TabBar;

	t_b = curobject.tab_bar;
	t_p = curobject.tab_page;
	t_f = curobject.tab_field;

	CurObject.tab_folder.ApplyStyleAttributes(
		f=t, change_bias=FALSE, set_gravity=FALSE);	//not applicable to tabfolder itself?

	CurObject.tab_bar.ApplyStyleAttributes(
		f=tb, change_bias=change_bias);

	CurObject.tab_page.ApplyStyleAttributes(
		f=tp, change_bias=change_bias, set_gravity=TRUE);

	CurObject.tab_field.ApplyStyleAttributes(
		f=tf, change_bias=change_bias, set_gravity=TRUE);


	t.SetAttribute(
		isshadowed=curobject.tab_folder.isshadowed,
		shadowcolor=curobject.tab_folder.shadowcolor,
		tagged_values=curobject.TaggedValues.Duplicate(),
		clientdata=null);

	tb.SetAttribute(
		tabbgcolor=t_b.tabbgcolor,
		normaltabcolor=t_b.normaltabcolor,
		normaltextcolor=t_b.normaltextcolor,
		normaltypeface=t_b.normaltypeface,
		normaltypefacename=t_b.normaltypefacename,
		normaltypesize=t_b.normaltypesize,
		selectedtabcolor=t_b.selectedtabcolor,
		selectedtextcolor=t_b.selectedtextcolor,
		selectedtypeface=t_b.selectedtypeface,
		selectedtypefacename=t_b.selectedtypefacename,
		selectedtypesize=t_b.selectedtypesize,
		shadowcolor=t_b.shadowcolor,
		tabshape=t_b.tabshape,
		tabgap=t_b.tabgap,	//-1 looks good too
		separation=t_b.separation,
		xmargin=t_b.xmargin,
		ymargin=t_b.ymargin,
		isfixedwidth=t_b.isfixedwidth,
		displaytext=t_b.displaytext,
		displaybitmap=t_b.displaybitmap,
		bitmapposition=t_b.BitmapPosition,
		bgbitmap=t_b.BgBitmap,
		tagged_values=t_b.TaggedValues.Duplicate(),
		clientdata=null);

	for i = 1 to t.tabpagearray.LastRow do
		tp = t.tabpagearray[i];
		tf = tp.TabField;

		tp.SetAttribute(
		outlinecolor=t_p.OutlineColor,
		outlinestyle=t_p.OutlineStyle,
		outlinewidth=t_p.OutlineWidth,
		bgcolor=t_p.BgColor,
		bgpattern=t_p.BgPattern,
		fgcolor=t_p.FgColor,
		isreverse=t_p.IsReverse,
		typeface=t_p.TypeFace,
		typefacename=t_p.TypeFaceName,
		typesize=t_p.TypeSize,
		tagged_values=t_p.TaggedValues.Duplicate(),
		clientdata=null);

		tf.SetAttribute(
		normalbitmap=t_f.NormalBitmap,
		selectedbitmap=t_f.SelectedBitmap,
		bgbitmap=t_f.BgBitmap,
		hasbitmap=t_f.HasBitmap,
		tagged_values=t_f.TaggedValues.Duplicate(),
		clientdata=null);
	endfor;
}

/*
**
**  Copyright (c) 2014 Actian Corporation. All Rights Reserved.
**
**
*******************************************************************************
**
**  Name:	tablefield_style_attributes
**
**  Description:
**	Apply stylesheet tablefield settings to the passed field
**
**  History:
**
**	25-aug-2014 (thrse01)
**	    Copied from internal tablefield_style_attributes.
***	30-aug-2014 (thrse01)
**	    Dont apply to null tableheaders
*/


method GetStyleAttributes
(
    t	= tablefield
) =
declare
    tb		= stackfield;
    th		= stackfield;
    cf		= columnfield;
enddeclare
{
    tb = t.TableBody;
    th = t.TableHeader;

    CurObject.HasHeaderButtons = t.HasHeaderButtons;

    CurObject.table_field.GetStyleAttributes(f = t);

    CurObject.header_stack.GetStyleAttributes(f = th);
    if (th is not null) then
	CurObject.header_field.GetStyleAttributes(f = th.ChildFields[1]);
    endif;

    CurObject.column_stack.GetStyleAttributes(f = tb);
    if (tb is not null) then
	cf = ColumnField(tb.ChildFields[1]);
	CurObject.column_field.GetStyleAttributes(f = cf);
	CurObject.proto_field.GetStyleAttributes(f = cf.ProtoField);
    endif;

    if (t.TitleTrim is not null) then
	CurObject.title_trim.GetStyleAttributes(f = t.TitleTrim);
    endif;
}



method ApplyStyleAttributes
(
    t			= tablefield,
    change_bias		= integer not null default TRUE,
    honor_unique_style	= integer not null default FALSE
) =
declare
    c		= columnfield;
    i		= integer not null;
    pf		= formfield;
    tb		= stackfield;
    th		= stackfield;
    form	= compositefield default null;
    status	= integer not null default FALSE;
    f		= formfield default null;
enddeclare
{

    if t.HasHeaderButtons != CurObject.HasHeaderButtons then
	t.HasHeaderButtons = CurObject.HasHeaderButtons;
    endif;


    tb = t.TableBody;
    th = t.TableHeader;

    CurObject.table_field.ApplyStyleAttributes
			    (
				f		= t,
				change_bias	= FALSE,	//backward compatibility
				set_gravity	= FALSE		//not applicable to tablefield itself
			    );

    if (t.TitleTrim is not null) then
	CurObject.title_trim.ApplyStyleAttributes
			    (
				f		= t.TitleTrim,
				change_bias	= change_bias,
				set_gravity	= TRUE
			    );
    endif;

    CurObject.header_stack.ApplyStyleAttributes
			    (
				f		= th,
				change_bias	= change_bias
			    );
    CurObject.column_stack.ApplyStyleAttributes
			    (
				f		= tb,
				change_bias	= change_bias
			    );

    if th is null then
    elseif (th.ChildFields is not null) then
	for i = 1 to th.ChildFields.lastrow do
	    CurObject.header_field.ApplyStyleAttributes
			    (
				f		= th.ChildFields[i],
				change_bias	= change_bias,
				set_gravity	= TRUE
			    );
	endfor;

	if t.ExactWidth != 0 then
	    form = t;
	    status = form.ChildFields.Find('classname', value='VIEWPORTFIELD',
		rownumber=Byref(i));
	    if status = ER_OK then
		form = CompositeField(t.ChildFields[i]).ChildFields[1];
		status = form.ChildFields.Find('classname', value='BUTTONFIELD',
			rownumber=Byref(i));
	    endif;
	    if status = ER_OK then
		f = form.ChildFields[i];
		CurObject.header_field.ApplyStyleAttributes
			    (
				f		= f,
				change_bias	= FALSE,	//don't mess with chucky
				set_gravity	= FALSE
			    );
	    endif;
	endif;
    endif;

    if (tb.ChildFields is not null) then
	for i = 1 to tb.ChildFields.lastrow do
	    c = columnfield(tb.ChildFields[i]);

	    if (honor_unique_style = FALSE or
			c.FieldStyle != 0) then
		CurObject.column_field.ApplyStyleAttributes
			    (
				f		= c,
				change_bias	= change_bias,
				set_gravity	= TRUE
			    );
	    endif;

	    pf = c.protofield;

	    /* (bug 113916) */

            c.SetAttribute
		    (
			updatebias	= pf.updatebias,
			querybias	= pf.querybias,
			readbias	= pf.readbias,
			user1bias	= pf.user1bias,
			user2bias	= pf.user2bias,
			user3bias	= pf.user3bias
		    );

	    if (honor_unique_style = FALSE or
			pf.FieldStyle != 0) then
		CurObject.proto_field.ApplyStyleAttributes
			    (
				f		= pf,
				change_bias	= change_bias
			    );
	    endif;

	endfor;
    endif;


}

