COMPONENT.script:
/*
** Copyright (c) 2014 Actian Corporation. All Rights Reserved.
*/
//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
//		SETUP AND EVENT CODE - DO NOT MODIFY
//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@

INITIALIZE =
DECLARE
  element_manager	= ElementManager;
  field_manager		= FieldManager;
  wizard		= Assistant;
  rc			= integer NOT NULL DEFAULT PU_OK;
  ct			= integer NOT NULL;
  changes		= ChoiceList DEFAULT NULL;
  preserves		= ChoiceList DEFAULT NULL;
  apps			= array of ChoiceDetail DEFAULT NULL;
  allapps		= ChoiceDetail DEFAULT NULL;

  w7			= Windows7style;

  ChangeField		= PROCEDURE RETURNING integer NOT NULL;
  ChangeFrame		= PROCEDURE RETURNING integer NOT NULL;
  ChangeCode		= PROCEDURE RETURNING integer NOT NULL;
  DefineChanges		= PROCEDURE RETURNING integer NOT NULL;
ENDDECLARE
BEGIN
/*
**  Set up the variables
*/
changes = FIELD(ChangesHolder).ValueList;
changesTo = FIELD(ChangesToHolder).ValueList;
apps = FIELD(applicationName).ValueList.ChoiceItems;
preserves = FIELD(PreservedFeatures).ValueList;

/*
**  Set the defaults and lists
*/
element_manager.GetApplicationsFromDatabase(
	appList=FIELD(applicationName).ValueList,
	exclusions='$_ApplicationName');

IF (FIELD(applicationName).ValueList.ChoiceItems.LastRow = 1) THEN
    CurFrame.InfoPopup(
	'Your database does not contain any applications.  ' +
	'Please run the upgrade utility ' +
	'using a database with applications.',
	MessageType = MT_ERROR);
    EXIT;
ENDIF;

allapps = apps[1];
apps.RemoveRow(rownumber=1);
apps.Sort(enumdisplay=AS_ASC);
apps.InsertRow(rowobject=allapps);

wizard.SetAttribute(
	Caller			= CurFrame;
	ApplicationList		= FIELD(ApplicationName);
	ScopeOfChangeList	= FIELD(ScopeOfChange);
	ChangesToList		= FIELD(ChangesToHolder).ValueList;
	ChangesList		= FIELD(ChangesHolder).ValueList;
	Processor		= element_manager;
	PreservedFeatures	= FIELD(PreservedFeatures).ValueList;
	TemplateName		= 'w7style');

FOR ct = 1 TO 20 DO changes.ChoiceItems.InsertRow(); ENDFOR;
CALLPROC DefineChanges();
FOR ct = 20 DOWNTO 1 DO
  IF changes.ChoiceItems[ct].EnumText != '' THEN CONTINUE; ENDIF;
  changes.ChoiceItems.RemoveRow(ct);
ENDFOR;

FIELD(ChangesToHolder).ValueList.
	ChoiceItems[changesTo.IndexByText('Fields')].IsSelected = TRUE;
FIELD(ChangesToHolder).ValueList.
	ChoiceItems[changesTo.IndexByText('Frames')].IsSelected = TRUE;
FIELD(ChangesHolder).ValueList.
	ChoiceItems[changes.IndexByText('W7style - fields')].IsSelected = TRUE;
FIELD(ChangesHolder).ValueList.
	ChoiceItems[changes.IndexByText('W7style - frames')].IsSelected = TRUE;

/*
**  Run the wizard-controlled processing
*/
WHILE (rc != PU_CANCEL) DO
    rc = wizard.Wizard();
ENDWHILE;

/*
**  Close
*/
EXIT;

END;



//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
//		DEVELOPER-EDITABLE CODE BEYOND THIS POINT
//@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
/*
**  If you want to output a count of changes made, set rc to true whenever a
**  change is made, leave it as false if a change is not made
**
**  If you are adding additional cases to the change-processing procedures
**  below, you will need to add corresponding changes.ChoiceItems[..]
**  statements to the DefineChanges procedure at the end of this script.
**  The assistant will display these as additional options, and use the
**  enumtext keyword from the statement to select the appropriate case to
**  execute.
*/


/*
** -----------------------------------------------------------------------------
** Field changes to apply
** -----------------------------------------------------------------------------
*/
PROCEDURE ChangeField (

  fieldToChange	= FieldObject DEFAULT NULL;
  frame		= FrameSource DEFAULT NULL;
  changeToApply	= varchar(32) NOT NULL;

)=
DECLARE
  rc		= integer NOT NULL DEFAULT ER_OK;
ENDDECLARE
BEGIN

CASE changeToApply OF

'W7style - fields':
/* -----------------------------------------------------------------------------
** Change all fields that are sensitive to W7 styling
*/
{

	rc = w7.RestyleField(fieldtorestyle=fieldtochange,
		frametorestyle=frame, style=wizard.TemplateName,
		preserves=FIELD(PreservedFeatures).ValueList);
}

default:
{
}

ENDCASE;

RETURN rc;
END;



/*
** -----------------------------------------------------------------------------
** Frame changes to apply
** -----------------------------------------------------------------------------
*/
PROCEDURE ChangeFrame (

  frame		= FrameSource DEFAULT NULL;
  changeToApply	= varchar(32) NOT NULL;

)=
DECLARE
  rc		= integer NOT NULL DEFAULT ER_OK;
ENDDECLARE
BEGIN

CASE changeToApply OF

'W7style - frames':
/* -----------------------------------------------------------------------------
** Change frame properties that are sensitive to W7 styling
*/
{
	w7.RestyleFrame(frametorestyle=frame, style=wizard.TemplateName);
}


default:
{
}
ENDCASE;

RETURN rc;
END;



/*
** -----------------------------------------------------------------------------
** Code changes to apply
** -----------------------------------------------------------------------------
*/
PROCEDURE ChangeCode (

  script	= StringObject DEFAULT NULL;
  fieldScript	= StringObject DEFAULT NULL;
  frame		= FrameSource DEFAULT NULL;
  fieldToChange	= FieldObject DEFAULT NULL;
  changeToApply	= varchar(32) NOT NULL;

)=
DECLARE
  rc		= integer NOT NULL DEFAULT ER_OK;
ENDDECLARE
BEGIN

CASE changeToApply OF

default:
{
}
ENDCASE;


RETURN rc;
END;



/*
** -----------------------------------------------------------------------------
** Define list of available conversions
** -----------------------------------------------------------------------------
**
**  Ensure the changes indexes are in order, without gaps, and not duplicated!
*/
PROCEDURE DefineChanges =
BEGIN
/*
**  Define Field Property changes (set enumvalue=1)
*/
changes.AddItem(
	EnumValue=1,
	TextValue='W7style - fields',
	BitmapValue=null,
	DisplayValue='Change field properties to simulate Windows 7 styling where appropriate');

/*
**  Define Frame Property changes (set enumvalue=2)
*/
changes.AddItem(
	EnumValue=2,
	TextValue='W7style - frames',
	BitmapValue=null,
	DisplayValue='Change frame properties to simulate Windows 7 styling where appropriate');

/*
**  Define Script changes (set enumvalue=3)
*/
	/* none at present */

END;

