COMPONENT.script:
/*
** Copyright (c) 2014 Actian Corporation. All Rights Reserved.
**
**
*******************************************************************************
**  Userclass name:	windows7style
**
**  Description:
**	Provides W7-like styling for OpenROAD applications, in conjunction
**	with the W7Style customized stylesheet.
**
**  History:
**	05-sep-2014 (thrse01)
**		Created.
**	25-sep-2014 (thrse01) Bug 128351
**		Mark tablefield titles with gravity=FA_TOPLEFT to ensure that
**		they are handled as fullwidth in the restyled frames.
**	21-apr-2014 (thrse01) Bug 129990
**		Some w7style settings are incorrect, primarily due to bug 129967.
*/

/*Context constants - contextno and styleno*/
#define $FORM_FLD		'1'
#define $TOPBAR_FLD		'2'
#define $TAILBAR_FLD		'3'
#define $TBL_FLD		'4'
#define $MENU_FLD		'99'
#define $DISPLAY_FLD		'9'	-- for completeness; not used

/*Named style constants - contextno*/
#define $TBL_HDR_FLD		'41'
#define $TOPBAR_ORANGE_FLD	'21'
#define $FORM_GROUPBOX_FLD	'11'
#define $DISPLAY_STRIP_FLD	'91'
#define $FORM_BTNBAR_FLD	'71'

/*Named style constants - styleno*/
#define $TBL_HDR_STYLENO	'5'	--"w7tblheader": buttonfields only
#define $TOPBAR_ORANGE_STYLENO	'6'	--"w7orange": buttonfields, entryfields
#define $DISPLAY_STRIP_STYLENO	'5'	--"w7strip": subforms only
#define $FORM_GROUPBOX_STYLENO	'6'	--"w7groupbox": subforms only
#define $FORM_BTNBAR_STYLENO	'7'	--"w7buttonbar": subforms only

#define $ICON_BMP_WIDTH		'24'
#define $ICON_BMP_HEIGHT	'24'

/*Miscellaneous*/
#define $INFO			'curmethod.Trace'
#define $WARN			'$INFO'

/*
**@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
**				INITIALIZE
**@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
*/
initialize =
declare
	w7			= $_ComponentName default null;
	pixeldensity		= Float8 not null;
enddeclare
{
	w7 = curobject;
	pixeldensity = Float8(cursession.PixelScreenHeight) / Float8(cursession.ScreenHeight);
}


/*
**@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
**				METHODS
**@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@
*/

/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Restyle the passed field
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	The restyling to apply depends on the field type, current fieldstyle,
**	and context (location) in the frame.
**	The principal contexts are: topform, tablefield, top mainbar, tail
**	mainbar.
**	("tail" mainbar means the bottom mainbar, but if right or left are
**	present they get the same treatment)
*/
method RestyleField(

	fieldtorestyle		= FieldObject default null;
	frametorestyle		= FrameSource default null;
	style			= varchar(65) not null default 'w7style';
	preserves		= ChoiceList default null;

)=
declare
	rc			= integer not null default ER_OK;
	fld			= FieldObject default null;
	fld_backup		= FieldObject default null;
	styleindex		= integer not null default 1;	//no obvious way to tune this
	styler			= FrameSource default null;
	tbl			= TableField default null;
	tb			= TabBar default null;
	stac			= StackField default null;
	trim			= BoxTrim default null;
	btn			= ButtonField default null;
	mf			= FormField default null;
	i			= integer not null;
	groupboxlabel		= varchar(256) not null default '';
	sub			= SubForm;
	parent			= CompositeField default null;
	grandparent		= CompositeField default null;
	orientation		= integer not null default -1;
	sizetofit		= integer not null default STF_SELF;
	indx			= integer not null default 0;
	cbmargin		= integer not null default 0;
	fields			= array of FormField default null;
	entries			= array of HashTableEntry default null;
	tagv			= TaggedValue default null;
	tblhdr			= StackField default null;

	xoff			= integer not null;
	yoff			= integer not null;
	halfwidth		= integer not null;
	numimages		= integer not null;
	icon			= BitmapObject default null;
	bitmap			= BitmapObject default null;
	stretchbmp		= BitmapObject default null;
	leftbmp			= BitmapObject default null;
	rightbmp		= BitmapObject default null;
	clearcolor		= integer not null default 0;
	classname		= varchar(32) not null default '';
	notabar			= integer not null default 0;
	shape			= ShapeField default null;
	oldshape		= ShapeField default null;
enddeclare
{
	fld = fieldtorestyle;
	fld_backup = fld.Duplicate();


	/*
	**  Ignore tabpages and tabfields
	**  (They were already handled by the tabfolder processing)
	*/
	if fld.IsA(class=TabPage) = TRUE
	or fld.IsA(class=TabField) = TRUE then
		$INFO('... processed as part of parent tabfolder.');
		return ER_OK;
	endif;

	/*
	**  Postpone dealing with tabbars
	**
	**  Tabbar has a problem:
	**  The tabbar's background must match the tabfolder's underlay,
	**  even if the tabfolder doesnt. The default setting may be OK
	**  (for W7 the default is the frame's inactive margin), but in some
	**  frames there may be a solid compositefield in the way, in which
	**  case we had better use that field's bgcolor.
	**  But we may not know what that field's final bgcolor is until the
	**  buttonbar processing (if any) has completed, so we store the
	**  tabbar against the parent in case we need to recolour it.
	*/
	if fld.IsA(class=TabBar) = TRUE then
		tb = fld;
		parent = tb.ParentField.ParentField;
		while parent.BgPattern = FP_CLEAR do
			parent = parent.ParentField;
			if parent is null then
				endloop;
			endif;
		endwhile;

		if parent is null then
			tb.BgPattern = FP_CLEAR;
		elseif parent.BgPattern = FP_BITMAP
		or parent.BgPattern = FP_BITMAPCLEAR then
			tb.BgPattern = FP_CLEAR;
		elseif parent != frametorestyle.TopForm then
			tb.TabBgColor = parent.BgColor;
			parent.SetTaggedValue(
				tag='tabbars&' + varchar(tb.InstanceIdentifier),
				item=tb);
		endif;

		$INFO('... processed as part of parent tabfolder.');
		return ER_OK;
	endif;

	/*
	**  Handle unconverted freetrim tablefield column headers
	**
	**  Before any processing of:
	**  - the tablefield: capture the original header
	**  - the freetrim: switch the new button for the original freetrim
	*/
	if fld.IsA(class=TableField) = TRUE then
		tblhdr = TableField(fld).TableHeader;
	endif;

	if fld.IsA(class=FreeTrim) = TRUE then
		if fld.ClientData is null then
		elseif fld.ClientData.IsA(class=ButtonField) = FALSE then
		elseif ButtonField(fld.ClientData).WhichTableField() is null then
		else
			fld = fld.ClientData;
		endif;
	endif;

	/*
	**  Get the stylesheet to apply
	*/
	styler = curmethod.ObjectSource.ParentApplication.FetchComponent(
		componentname=style);
	w7.StyleSheet = styler.FldDefs;

	/*
	**  Apply the preserves;
	**  Get the styleindex
	*/
	rc = w7.ApplyPreservesToField(
		targetfield=fld, targetframe=frametorestyle,
		styleindex=Byref(styleindex), preserves=preserves);

	/*
	**  Deal with menu fields
	**
	**  Currently we do nothing, but we may start adding images
	**  once image support is in place
	*/
	if fld.IsA(class=MenuField) = TRUE then
		return ER_OK;
	endif;

	/*
	**  Switch styleindex ..if this is a subform with a groupbox label
	*/
	fld.GetAttribute(groupboxlabel=Byref(groupboxlabel));
	if fld.IsA(class=SubForm) = TRUE and groupboxlabel != '' then
		styleindex = $FORM_GROUPBOX_STYLENO;
	endif;

	/*
	**  Apply the standard settings using the standard mechanism;
	**  Get back the modelfield and (for freetrim column headers) the
	**  corresponding buttonfield
	*/
	rc = w7.ApplyStyleToField(targetfield=Byref(fld), styleindex=styleindex,
		modelfield=Byref(mf));

	/*
	**  Apply any field-level tag settings controlling the inputevent behaviour
	*/
	rc = w7.ApplyStyleEventResponses(targetfield=fld, styleindex=styleindex);

	/*
	**  Apply any other special settings the standard mechanism can't handle
	*/
	case Lowercase(fld.ClassName) of

	'tablefield':
	{
		tbl = fld;

		/*
		**  Freetrim column headers: these are orphaned at this point
		**  in favour of buttonfield headers, but PropertyChanger will
		**  still deliver the original freetrim fields for customizing.
		**  So we need to set up a mapping now that can be used to
		**  switch in the new buttons instead.
		*/
		if tblhdr is null then	/*should never be the case*/
		elseif tblhdr.ChildFields[1].IsA(class=FreeTrim) = TRUE then
			for i = 1 to tblhdr.ChildFields.LastRow do
				trim = tblhdr.ChildFields[i];
				trim.ClientData = tbl.TableHeader.ChildFields[i];
			endfor;
		endif;
	}

	'buttonfield':
	{
		btn = fld;

		/*
		**  height: W7 rounded buttons are 22px high, W7 tablefield
		**  header buttons are 24px high. Leave all other buttons at
		**  their previous height
		*/
		if styleindex = $FORM_FLD
		or styleindex = $TAILBAR_FLD
		or styleindex = $TBL_HDR_STYLENO then
			fld.SetAttribute(OuterHeight = ButtonField(mf).OuterHeight);
		endif;

		/*
		**  focusbehavior: W7 rounded buttons can be tabbed to; other
		**  buttons cannot be tabbed to or hold the focus when clicked
		*/
		if fld.FocusBehavior != FT_TABTO then
			fld.FocusBehavior = ButtonField(mf).FocusBehavior;
		endif;

		/*
		**  buttonbar: W7 rounded text buttons are typically horizontally
		**  arranged, right justified, in the inactive area at the
		**  bottom of the frameform, which means the underlying
		**  background should not be active window but inactive margin.
		**  In OpenROAD such buttons are usually in a "buttonbar" stack
		**  at the bottom of the frame, often within a vertical stack
		**  which also includes the main display panel, so ideally we
		**  identify the buttonbar and move it into mainbarbottom[1]
		**  inside an STF_FRAMEHORIZONTAL subform and adjust the
		**  bgcolor of the buttonbar. Unfortunately moving it will
		**  very likely change the button fullnames (because many older
		**  applications have named their buttons and even their layout
		**  compositefields) and break the frame code.
		**  So instead we wrap the buttonbar in the subform in situ,
		**  and change the background of the buttonbar's parentfield if
		**  it is a stack, so that the buttonbar appears to be in the
		**  inactive area. The client developer can easily identify and
		**  move/recolour such fields subsequently.
		*/
		parent = btn.ParentField;
		grandparent = parent.ParentField;

		orientation = -1;
		parent.GetAttribute(orientation=Byref(orientation));
		if grandparent is not null then
			grandparent.GetAttribute(sizetofit=Byref(sizetofit));
		endif;

		/*
		/*
		**  Look for text buttonbar in a horizontal stackfield
		**  (excluding buttons in tablefields and mainbars, and
		**   ones already in a subform buttonbar)
		*/
		if sizetofit = STF_FRAMEHORIZONTAL then
		elseif btn.WhichTableField() is not null then
		elseif btn.IsDescendantOf(ancestor=frametorestyle.TopForm) = FALSE then
		elseif parent.IsA(class=StackField) = TRUE and orientation = FO_HORIZONTAL then

			/*
			**  Check that it does only contain buttons and spacers
			*/
			fields = parent.ChildFields;
			for i = 1 to fields.LastRow do
				classname = Lowercase(fields[i].ClassName);
				if  classname != 'buttonfield'
				and classname != 'rectangleshape' then
					notabar = TRUE;
					endloop;
				endif;
			endfor;

			/*
			**  Use the stackfield that contains the lowest field on
			**  the topform ..if it contains our button
			*/
			fields = frametorestyle.TopForm.FieldsByProperty();
			fields.Sort(AbsYTop=AS_DESC);
			if parent = fields[1].ParentField
			and notabar = FALSE then

				$INFO('Applying buttonbar right-alignment to button-stack containing ' + btn.FullName);

				grandparent.ChildFields.Find(
					attributename='instanceidentifier',
					value=parent.InstanceIdentifier,
					rownumber=Byref(indx));
				sub = w7.GetFieldFromStyleSheet(
					f=sub, styleindex=$FORM_BTNBAR_STYLENO);
				sub.SetAttribute(designbias=FB_FLEXIBLE,
					xleft=0, ytop=0, gravity=FA_NONE);

				/*
				**  Wrap the buttonbar in a subform;
				**  Reset the properties of buttonbar and
				**  underlay to get a consistent background and
				**  behaviour
				*/
				if grandparent.IsA(class=StackField) = TRUE then
					stac = grandparent;
					stac.InsertChild(fieldtoinsert=sub, position=indx);
					stac.SetAttribute(bgcolor=sub.BgColor);

					/*
					**  Reset the background of any tabbar affected
					**  by a change in the buttonbar's underlay
					*/
					tagv = stac.FetchTaggedValue(tag='tabbars');
					if tagv is not null then
						stac.RemoveTaggedValue(tag='tabbars');
						entries = HashTable(tagv.tag_item).Entries;
						for i = 1 to entries.LastRow do
							tb = entries[i].Object;
							tb.TabBgColor = stac.bgColor;
						endfor;
					endif;
				else
					sub.SetAttribute(
						ParentField=grandparent,
						AbsXLeft=parent.AbsXLeft,
						absytop=parent.AbsYTop,
						layersequence=parent.LayerSequence);
				endif;

				parent.SetAttribute(
					parentfield=sub, ytop=0, xleft=0);
				sub.SetAttribute(
					height=parent.OuterHeight,
					childrightmargin=73,
					childgravity=FA_CENTERRIGHT,
					sizetofit=STF_FRAMEHORIZONTAL);
				parent.SetAttribute(
					BgColor=sub.BgColor);
			endif;
		endif;

		/*
		**  Button icons: In W7 these are apart, and mouseover highlighted
		**  by a rounded-button outline with the icon in the centre
		**
		**  Simplest is to get the required multiimage bitmap from a
		**  template version and embed the icon in each image; this
		**  would mean the size is non-negotiable however. Collecting
		**  the icons together as sprite icons in a shared copy of the
		**  template version would be an efficient and flexible
		**  alternative, but requires more elaborate setup.
		*/
		if btn.BitmapLabel is not null then
			icon = btn.BitmapLabel;
			icon = icon.ExtractBitmap();
			if icon is null then
				$WARN('BitmapLabel image in field "' +
					btn.FullName + '" in frame "' +
					frametorestyle.Name + '" cannot be copied');
			endif;
			clearcolor = icon.GetPixelColor(x=1, y=1);

			mf = w7.GetFieldFromStyleSheet(
				f=btn, styleindex=$TOPBAR_FLD);
			mf.GetAttribute(bgbitmap=Byref(bitmap));
			bitmap = bitmap.Duplicate();
			halfwidth = bitmap.WidthPixels/2;
			stretchbmp = bitmap.ExtractBitmap(
				xstart=halfwidth, width=1);
			leftbmp = bitmap.ExtractBitmap(
				xstart=1, width=halfwidth);
			rightbmp = bitmap.ExtractBitmap(
				xstart=bitmap.WidthPixels-halfwidth+1,
				width=halfwidth);

			bitmap = stretchbmp.ResizeBitmap(width=$ICON_BMP_WIDTH,
				height=stretchbmp.HeightPixels);
			bitmap = bitmap.ReplaceBitmap(
				replacement=leftbmp, x=1, y=1, clearcolor=-1);
			bitmap = bitmap.ReplaceBitmap(
				replacement=rightbmp, x=$ICON_BMP_WIDTH-rightbmp.WidthPixels+1, y=1, clearcolor=-1);

			xoff = ($ICON_BMP_WIDTH - icon.WidthPixels)/2;
			yoff = ($ICON_BMP_HEIGHT - icon.HeightPixels)/2;
			numimages = (bitmap.HeightPixels+1)/($ICON_BMP_HEIGHT+1);

			for i = 1 to numimages do
				bitmap = bitmap.ReplaceBitmap(
					replacement=icon, x=xoff+1, y=yoff+1,
					clearcolor=clearcolor);
				yoff = yoff + $ICON_BMP_HEIGHT + 1;
			endfor;

			btn.SetAttribute(
				width=Float8(bitmap.WidthPixels)/pixeldensity,
				height=Float8($ICON_BMP_HEIGHT)/pixeldensity,
				bitmaplabel=null, bgbitmap=bitmap.Duplicate(),
				bgdisplaypolicy=BDP_CORNERED, bgpattern=FP_BITMAPCLEAR);

			btn.BgBitmap.CornerRadius = 2;

		endif;

	}


	'freetrim':
	{
		trim = fld;

		/*
		**  Background: the freetrim must match its background, unless
		**  we bitmapped it
		*/
		if trim.BgPattern != FP_BITMAPCLEAR
		and trim.BgPattern != FP_BITMAP then
			trim.BgPattern = FP_CLEAR;
		endif;

		/*
		**  tbl title: W7 titles are full width, left-aligned, bold
		**
		**  Since the tablefield will not have resized (shrunk) yet to
		**  allow for font changes, signal the fullwidth requirement
		**  by setting the title's gravity to FA_TOPLEFT.
		**  We also need a "separator line" between the title and the
		**  column headers - the only way we can do this is by a top
		**  margin on the tableheader, with an appropriate background
		*/
		tbl = fld.WhichTableField();
		if tbl is null then
		elseif fld != tbl.TitleTrim then
		else
			tbl.TitleTrim.ExactWidth = tbl.Width;
			tbl.TitleTrim.IsBold = TRUE;
			tbl.TitleTrim.Gravity = FA_TOPLEFT;

			if tbl.TableHeader is null then
			elseif tbl.TableHeader.OutlineWidth != LW_NOLINE then
			elseif tbl.TableHeader.ChildTopMargin != 0 then
			else
				tbl.TableHeader.SetAttribute(
					childtopmargin=10, bgcolor=CC_SYS_ACTIVECAPTION);
			endif;
		endif;
	}

	'rectangleshape':
	{
		shape = fld;
		oldshape = fld_backup;

		/*
		**  Background: the rectangle should continue to be invisible
		**  against its background ..if it was before (probably a spacer)
		*/
		if shape.ParentField.Isa(class=StackField) = TRUE
		and (oldshape.BgPattern = FP_SOLID or oldshape.BgPattern = FP_DEFAULT)
		and oldshape.UpdateBias != FB_INVISIBLE
		and oldshape.LineWidth = LW_NOLINE then
			shape.Setattribute(
				LineWidth = LW_NOLINE,
				BgColor=shape.ParentField.BgColor);
		endif;
	}

	'mainbar':
	{
		/*
		**  BDP_CORNERED-unpainted bug: until this is fixed we need
		**  this BDP_BORDEREDSCALED to make the background visible
		*/
		if frametorestyle.MainbarTop.LastRow = 0 then
		elseif fld = frametorestyle.MainbarTop[1] then
			fld.SetAttribute(BgDisplayPolicy=BDP_BORDEREDSCALED);
		endif;
	}

	default:
	{

	}

	endcase;

	/*
	**  Restore any "preserved settings" overridden by the styling
	*/
	rc = w7.RestorePreservesToField(
		targetfield=fld, restorefield=fld_backup, preserves=preserves);

	/*
	**  Do more special tagging for tablefield headers
	*/
	if fld.GetTagText(tag='in tbl') = '' then
		;
	elseif fld.IsA(class=StackField) = TRUE then
		fld.RemoveTaggedValue(tag='in tbl');
		stac = StackField(fld);
		for i = 1 to stac.ChildFields.LastRow do
			btn = stac.ChildFields[i];
			btn.SetTaggedValue(
				tag='in tbl', textvalue='yeah');
		endfor;
	else
		fld.RemoveTaggedValue(tag='in tbl');
	endif;

	/*
	**  Go back to original field styling ..if appropriate
	**  (defensive - such fields should have been explicitly
	**   excluded; replace the 1 = 0 condition by whatever
	**   conditions will identify such fields)
	*/
	if 1 = 0 then
		fld = fld_backup.Duplicate();
	endif;

	return rc;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Restyle the passed frame
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
*/
method RestyleFrame(

	frametorestyle		= FrameSource default null;
	style			= varchar(65) not null default 'w7style';

)=
declare
	rc			= integer not null default ER_OK;
	styler			= FrameSource default null;
	i			= integer not null;
	workpanel		= FormField default null;
	size			= integer not null;
	maxsize			= integer not null;
	fields			= array of FormField default null;
enddeclare
{

	styler = curmethod.ObjectSource.ParentApplication.FetchComponent(
		componentname=style);
	w7.StyleSheet = styler.FldDefs;

	/*
	**  Apply any frame-level tag settings controlling the inputevent behaviour
	**  (these are usually in the framesource's TopForm, rather than the
	**   framesource itself)
	*/
	rc = w7.ApplyStyleEventResponses(
		targetframe=frametorestyle);

	/*
	**  Copy the stylesheet from the frametemplate to this frame
	*/
	frametorestyle.FieldDefaults = w7.styleSheet.Duplicate();

	/*
	**  Offset the working area ..if it is topleft
	**
	**  W7 displays are offset from the frame topleft
	*/
	fields = frametorestyle.TopForm.ChildFields;
	for i = 1 to fields.LastRow do
		size = fields[i].Width * fields[i].Height;
		if size > maxsize then
			maxsize = size;
			workpanel = fields[i];
		endif;
		if fields[i].XLeft > 0 and fields[i].Ytop > 0 then
			workpanel = null;
		endif;
	endfor;

	if workpanel is not null then
		workpanel.SetAttribute(gravity=FA_NONE, Xleft=73, YTop=73);
	endif;

	return rc;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Apply any tag settings controlling the inputevent behaviours
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
*/
method ApplyStyleEventResponses(

	targetfield		= FieldObject default null;
	targetframe		= FrameSource default null;
	styleindex		= integer not null default 1;

)=
declare
	rc			= integer not null default ER_OK;
	i			= integer not null;
	fld			= FormField default null;
	fld_backup		= FormField default null;
	fullkey			= varchar(256) not null;
	mf			= FormField default null;
	tv			= TaggedValue default null;
	responseentries		= array of HashTableEntry default null;
	intervalentries		= array of HashTableEntry default null;
enddeclare
{
	/*
	**  Ignore menu fields
	**  (at present we have no style processing for these)
	*/
	if targetfield is null then
		;
	elseif targetfield.IsA(class=MenuField) = TRUE then
		return ER_OK;

	/*
	**  Ignore subfields of tablefield as well
	**  (handling for tablefield takes care of these)
	*/
	elseif targetfield.WhichTableField() is not null then
		return ER_OK;

	/*
	**  Ignore subfields of tabfolder too
	**  (handling for tabfolder takes care of these)
	*/
	elseif targetfield.IsA(class=TabPage) = TRUE
	or targetfield.IsA(class=TabBar) = TRUE
	or targetfield.IsA(class=TabField) = TRUE then
		return ER_OK;
	endif;

	/*
	**  Ensure we have adequate info to continue
	*/
	if targetfield is not null then
		fld = targetfield;
	elseif targetframe is not null then
		fld = targetframe.TopForm;
	else
		return ER_FAIL;
	endif;

	/*
	**  Get the event_responses tag from the corresponding model field;
	**  Remove matching existing tag hash settings;
	**  Apply its tag hash settings
	*/
	mf = w7.GetFieldFromStyleSheet(f=fld, styleindex=styleindex);

if mf is null then
	return ER_FAIL;
endif;

if mf.tagged_values is null then
	$INFO(mf.ClassName + '.' + varchar(styleindex) +
		' in stylesheet has NULL tagged values. Continuing ...');
	return ER_FAIL;
endif;

if mf.tagged_values.LastRow = 0 then
	return ER_FAIL;
endif;

	tv = mf.FetchTaggedValue(tag='event_responses');
	if tv is not null then
		responseentries = HashTable(tv.tag_item).GetEntries();
	endif;

if responseentries is null then
	return ER_FAIL;
endif;

	$INFO(mf.ClassName + '.' + varchar(styleindex) +
		': applying defined responses from stylesheet');

	for i = 1 to responseentries.LastRow do
		fullkey = 'event_responses&' + responseentries[i].key;
		fld.SetTaggedValue(tag=fullkey, item=null);
		fld.SetTaggedValue(
			tag=fullkey, item=responseentries[i].Object.Duplicate());
	endfor;

	intervalentries = HashTable(mf.FetchTaggedValue(tag='event_intervals').
		tag_item).GetEntries();
	for i = 1 to intervalentries.LastRow do
		fullkey = 'event_intervals&' + intervalentries[i].key;
		fld.SetTaggedValue(tag=fullkey, item=null);
		fld.SetTaggedValue(
			tag=fullkey, item=intervalentries[i].Object.Duplicate());
	endfor;

	return rc;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Apply fixed and optional preserves to field
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	Some features of the existing frame must be preserved; other features
**	should be preserved if the developer says so.
**	"Must" features include:
**	- BgPattern=FP_CLEAR: this must not be overridden (bdp settings can
**	  still be applied)
**
**	Optional features include:
**	- Fieldstyle=0,1: these must not be overridden (if a tbl
**	  protofield has a fieldstyle of 1, this must be intentional)
*/
method ApplyPreservesToField(

	targetfield		= FieldObject default null;
	targetframe		= FrameSource default null;
	styleindex		= integer not null default 1;
	preserves		= ChoiceList default null;

)=
declare
	fld		= FormField DEFAULT NULL;
	frame		= FrameSource default null;
	rc		= integer NOT NULL;
	i		= integer NOT NULL;
	context		= integer NOT NULL;
	asel		= integer not null DEFAULT FALSE;
	bsel		= integer not null DEFAULT FALSE;
	usel		= integer not null DEFAULT FALSE;
	osel		= integer not null DEFAULT FALSE;
	iprop		= integer not null DEFAULT FALSE;
	styleno		= integer not null default 1;
enddeclare
{

	/*
	**  Ignore menufields - no preserves and no styling at present
	*/
	if targetfield.IsA(class=MenuField) = TRUE then
		return ER_OK;
	endif;

	fld = targetfield;
	frame = targetframe;

	/*
	**  Make no style changes to this field
	**  ..if it is fieldstyle unique and preserve unique was selected
	*/
	usel = preserves.ChoiceItems[preserves.IndexByText('unique')].IsSelected;
	if usel = TRUE and fld.FieldStyle = 0 then
		styleindex = fld.FieldStyle;
		return ER_OK;
	endif;

	/*
	**  Determine the context of this field
	**
	**  Context and fieldstyle constants are identical to keep things simple.
	*/
	context = curobject.GetFieldContext(targetfield=fld, targetframe=frame);

	/*
	**  Change all non-default fieldstyles to settings appropriate to their
	**  context
	**
	**  Any attempt to preserve existing settings (other than fieldstyle=1)
	**  is likely to give a mish-mash of styles, and would make assigning
	**  named styles more complex.
	*/
	if fld.FieldStyle != 1 then

		case context of

		$MENU_FLD:	return ER_FAIL;	//should never happen
		$FORM_FLD:	fld.FieldStyle = $FORM_FLD;
		$TBL_FLD:	fld.FieldStyle = $TBL_FLD;
		$TOPBAR_FLD:	fld.FieldStyle = $TOPBAR_FLD;
		$TAILBAR_FLD:	fld.FieldStyle = $TAILBAR_FLD;
		$TBL_HDR_FLD:	fld.FieldStyle = W7.StyleIndexFromName(fld=fld, stylename='w7tblheader');
		$TOPBAR_ORANGE_FLD: fld.FieldStyle = W7.StyleIndexFromName(fld=fld, stylename='w7orange');
		default:	fld.FieldStyle = $FORM_FLD;

		endcase;

	endif;

	/*
	**  Use default styleindexes where named entries have been omitted by
	**  the developer
	*/
	if fld.FieldStyle = 0 then
		case context of
		$TBL_HDR_FLD:		fld.FieldStyle = 5;
		$TOPBAR_ORANGE_FLD:	fld.FieldStyle = 6;
		default:		fld.FieldStyle = 1;
		endcase;
	endif;

	styleindex = fld.FieldStyle;	//for byref

	/*
	**  Preserve (button) autosizing
	**  ..if preserve autosize was specified
	*/
	asel = preserves.ChoiceItems[preserves.IndexByText('autosized')].IsSelected;
	if asel = FALSE then	/*FALSE requires explicit removing, since styling doesnt*/
		fld.GetAttribute(isautosized=Byref(iprop));
		if iprop = TRUE then
			fld.SetAttribute(isautosized=FALSE);
		endif;
	endif;

	/*
	**  Remove the bitmap label(s)
	**  ..if remove bitmaplabel was specified
	*/
	bsel = preserves.ChoiceItems[preserves.IndexByText('bitmaplabels')].IsSelected;
	if bsel = TRUE then	/*TRUE means remove the bitmaplabel(s)*/
		fld.SetAttribute(bitmaplabel=NULL, offbitmaplabel=NULL, onbitmaplabel=NULL);
	endif;

	/*
	**  Use orange highlighting for topbar fields
	**  ..if orange highlighting was specified
	*/
	osel = preserves.ChoiceItems[preserves.IndexByText('orange')].IsSelected;
	if osel = TRUE and context = $TOPBAR_FLD then
		styleno = W7.StyleIndexFromName(fld=fld, stylename='w7orange');
		fld.SetAttribute(fieldstyle=styleno);
	endif;

	return rc;
}


/*
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**	Restore preserves to field
**~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
**
**	Restore any mandatory or optional "preserved settings" overridden
**	by the styling.
*/
method RestorePreservesToField(

	targetfield		= FieldObject default null;
	restorefield		= FieldObject default null;
	preserves		= ChoiceList default null;

)=
declare
	rc			= integer not null default ER_OK;
	fld			= FieldObject default null;
	rfld			= FieldObject default null;
	fsel			= integer not null DEFAULT FALSE;
	fontface		= integer not null;
	fontname		= varchar(256) not null;
	fontsize		= integer not null;
	bgpattern		= integer not null;
enddeclare
{
	fld = targetfield;
	rfld = restorefield;

	/*
	**  Restore font settings
	*/
	fsel = preserves.ChoiceItems[preserves.IndexByText('font')].IsSelected;
	if fsel = TRUE then
		rfld.GetAttribute(
			TypeFace=Byref(fontface),
			TypeFaceName=Byref(fontname),
			TypeSize=Byref(fontsize));
		fld.SetAttribute(
			TypeFace=fontface,
			TypeFaceName=fontname,
			TypeSize=fontsize);
	endif;

	/*
	**  Restore FP_CLEAR setting
	*/
	rfld.GetAttribute(bgpattern=Byref(bgpattern));
	if bgpattern = FP_CLEAR then
		fld.SetAttribute(bgpattern=bgpattern);
	endif;

	return rc;
}
